INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, "ここに困ってる人は\nいないよね…？\nよかった♪", 1, 1, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (2, "冒険の準備準備…\nうん、忘れ物はなし！\n…あっ！", 2, 1, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (3, "リズムを意識して…\nわんつーわんつー！\nうん、調子はバッチリ", 3, 1, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (4, "ここで特訓していい？\n物は壊さないように\n気をつけるね！", 4, 1, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (5, "なんか落ち着かないや\nもしかして、\n困ってる人が\n近くにいるのかな…？", 5, 1, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (6, "えへへ…いつも\n一緒にいてくれて\nありがとねっ！", 101, 1, 0, 0, 1, 100101, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (7, "ちゃんと覚えてるよ\n騎士くんの声…\nあの時はありがとね！", 102, 1, 0, 0, 1, 100101, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (8, "あははっ！\nやったなー！\nお返しだー！\nこちょこちょこちょ…", 1, 2, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (9, "どうしたの？\nもしかして困ってる？\nあたしにまかせて！", 2, 2, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (10, "えっとね…しっぽは\n触っちゃダメだよ？", 3, 2, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (11, "反応しない特訓…\nだったけど無理～！\n悔しいよぉ～！", 4, 2, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (12, "ふぁふぃ？\nやられた～！　ほっぺ\nぷにぷにしないでぇ～", 101, 2, 0, 0, 1, 100101, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (13, "えへへ…\n騎士くんの手だ…\nあったかいな…♪", 102, 2, 0, 0, 1, 100101, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (14, "おはよー！\n今日も元気に\nいっちゃうよー！", 1, 2, 0, 1, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (15, "ユイちゃんに\nおやつ作って\nもらおうかな～♪", 2, 2, 0, 2, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (16, "寝るのも修行だって\nこないだレイさんが\n言ってたんだ…", 3, 2, 0, 3, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (17, "ちゃんとケアして\n傷が残らないように\nしないと…", 1, 3, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (18, "一回休むと\nこのままずるずる\nいきそう…", 2, 3, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (19, "新しい練習相手に…\nって冗談だよ冗談！\n本気じゃないから！", 3, 3, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (20, "落ち着くなぁ～\n心だけじゃなくて\n体もほぐれそう♪", 4, 3, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (21, "あったかい所に\nいると体が丸く\nなっちゃう…", 5, 3, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (22, "いつ何が起きるか\n分からないし、\nもっと力をつけないと", 6, 3, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (23, "美味しいけど、\n食べ過ぎないように\nしないと…！！", 7, 3, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (24, "文字が多いと\n眠くなっちゃう…\n危ない危ない！", 8, 3, 0, 0, 1, 100101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (26, "リズムを意識して…\nわんつーわんつー！\nうん、調子はバッチリ", 1, 1, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (27, "のんびりするのって\n退屈かも…\n何かして遊ばない？", 2, 1, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (28, "留守番はちょっと\n苦手かも…\nなんか寂しいんだもん", 3, 1, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (29, "あたしのお友達も\n呼んできていい？\nきっと楽しいよ！", 4, 1, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (30, "誰も困ってないよね？\n…何をすれば\nいいのか分かんないや", 5, 1, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (31, "ちゃんと覚えてるよ\n騎士くんの声…\nあの時はありがとね！", 101, 1, 0, 0, 1, 100102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (32, "…なんであたし\n騎士くんばっかり\n見てるんだろ…", 102, 1, 0, 0, 1, 100102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (33, "反応しない特訓…\nだったけど無理～！\n悔しいよぉ～！", 1, 2, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (34, "触るのって楽しい？\n…そっか\n少しだけだよ…？", 2, 2, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (35, "あたしの元気を\nわけてあげるね！\nフレー！　フレー！", 3, 2, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (36, "何かムズムズする！？\nって騎士くんかぁー\nどしたの？", 4, 2, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (37, "ひゃうっ！　もう…\nしっぽはだめだってば\n次やったらデコピン！", 101, 2, 0, 0, 1, 100102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (38, "えへへ…\n騎士くんの手だ…\nあったかいな…♪", 102, 2, 0, 0, 1, 100102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (39, "朝ごはんと運動！\nこれがあたしの\n元気の素だよ！", 1, 2, 0, 1, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (40, "ユイちゃんに\nおやつ作って\nもらおうかな～♪", 2, 2, 0, 2, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (41, "寝るのも修行だって\nこないだレイさんが\n言ってたんだ…", 3, 2, 0, 3, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (42, "これでよし♪\n騎士くん\n気づくかな…？", 1, 3, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (43, "一回休むと\nこのままずるずる\nいきそう…", 2, 3, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (44, "新しい練習相手に…\nって冗談だよ冗談！\n本気じゃないから！", 3, 3, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (45, "こういうの\nなんか気になって\nじーって見ちゃうんだ", 4, 3, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (46, "あったかい所に\nいると体が丸く\nなっちゃう…", 5, 3, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (47, "いつ何が起きるか\n分からないし\nもっと力をつけないと", 6, 3, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (48, "お腹が減ると\nなんか力が\n出ないんだよね…", 7, 3, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (49, "色んなことを\n知っておくのは\n大事だよね！", 8, 3, 0, 0, 1, 100102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (51, "お片付けも済んだし\n今度は洗濯ものを\nたたもうかな", 1, 1, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (52, "この気持ち\nもっとちゃんと\n伝えなくっちゃ…", 2, 1, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (53, "お茶をいれようと\n思うんだけど\n他に飲みたい人は\nいるかな？", 3, 1, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (54, "戦いは\n得意じゃないけど\nお料理なら…！", 4, 1, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (55, "こういう平和な\n時間が、もっと\n続くといいな", 5, 1, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (56, "わたし…\nもうちょっとだけ勇気\n出してみようかな", 101, 1, 0, 0, 1, 100201, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (57, "みんなのことが大好き\nも、もちろん、\n騎士クンのことも…\nな、仲間として！", 102, 1, 0, 0, 1, 100201, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (58, "ひゃうっ！\nな、なに？\nびっくりしたぁ…", 1, 2, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (59, "男の子って、\nやっぱりおっきいね。\nその…手とか\n他にもいろいろ…", 2, 2, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (60, "困ったことが\nあったら\nいつでも話してね", 3, 2, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (61, "え！　む、虫っ！？\n取って取って！\nはやく～！", 4, 2, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (62, "あのね…\n一緒におでかけ\nしたいんだけど…\nダメかな？", 101, 2, 0, 0, 1, 100201, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (63, "騎士クンに\n伝えたいことがあるの\nとっても大切な…\nこ、今度、話すね！", 102, 2, 0, 0, 1, 100201, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (64, "お、おはよう！\nあの…朝ごはんは\nもう食べちゃった？", 1, 2, 0, 1, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (65, "お昼休みだね\nあの…良かったら\nお弁当…食べない？", 2, 2, 0, 2, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (66, "遅くまでお疲れ様\n明日も頑張ろうね\nふわぁ…", 3, 2, 0, 3, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (67, "よし…\nこれなら\n褒めてもらえるかな？", 1, 3, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (68, "がんばることも\n必要だけど、\nお休みも大切だよね", 2, 3, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (69, "かわいいなぁ…\nわたしも今度\n作ってみよう。\nえっと、材料は…", 3, 3, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (70, "戦う前にもこうやって\n落ち着けたら\nいいのに", 4, 3, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (71, "…はへっ？\nも、もしかして今\n寝ちゃってた…？", 5, 3, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (72, "騎士クンと一緒に\n冒険するなら\n体力がないと…！", 6, 3, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (73, "おいしいものって\n食べ過ぎちゃうけど…\nしょうがない…よね？", 7, 3, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (74, "…そっか\nこうすれば魔法が\nもっと強くなるんだ", 8, 3, 0, 0, 1, 100201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (76, "洗濯と掃除\nどっちから\nはじめよう？", 1, 1, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (77, "新しい魔道書を\n買いに行かなくちゃ\nもっとたくさん\n魔法を覚えたいな", 2, 1, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (78, "お茶をいれようと\n思うんだけど\n他に飲みたい人は\nいるかな？", 3, 1, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (79, "今日はどんな料理に\n挑戦しよう…♪", 4, 1, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (80, "この気持ち\nもっとちゃんと\n伝えなくっちゃ…", 5, 1, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (81, "みんなのことが大好き\nも、もちろん\n騎士クンのことも…\nな、仲間として！", 101, 1, 0, 0, 1, 100202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (82, "騎士クンのそばに\nいられるだけで\n幸せだよ", 102, 1, 0, 0, 1, 100202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (83, "えっと、その…\nこんな所で\nこういうことされると\n恥ずかしいよ…", 1, 2, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (84, "え！　む、虫っ！？\n取って取って！\nはやく～！", 2, 2, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (85, "あ、あの…実は\n騎士クンのこと…\nううん、やっぱり\nなんでもない", 3, 2, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (86, "男の子って\nやっぱりおっきいね\nその…手とか\n他にもいろいろ…", 4, 2, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (87, "騎士クンに\n伝えたいことがあるの\nとっても大切な…\nこ、今度、話すね！", 101, 2, 0, 0, 1, 100202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (88, "ふふふっ…そんなとこ\nツンツンしないで\nくすぐったいよ～", 102, 2, 0, 0, 1, 100202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (89, "おはよう\nよく眠れた？　今日も\n一日、頑張ろうね♪", 1, 2, 0, 1, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (90, "お腹空いちゃった…\nそうだ。騎士クンも\n一緒にお昼食べない？", 2, 2, 0, 2, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (91, "もうこんな時間…\nそろそろ寝なくちゃ\nおやすみなさい", 3, 2, 0, 3, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (92, "よし…\nこれなら\n褒めてもらえるかな？", 1, 3, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (93, "がんばることも\n必要だけど\nお休みも大切だよね", 2, 3, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (94, "かわいい～♪\n騎士クンは\nこういうのって好き？", 3, 3, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (95, "戦う前にもこうやって\n落ち着けたら\nいいのに", 4, 3, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (96, "あの…！\nよ、良かったら\n一緒に…！", 5, 3, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (97, "騎士クンと一緒に\n冒険するなら\n体力がないと…！", 6, 3, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (98, "最近服のサイズが\n合わないんだけど…\n食べ過ぎなのかな？", 7, 3, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (99, "…やっぱり\n月刊恋愛指南は\nためになる…", 8, 3, 0, 0, 1, 100202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (101, "装備の手入れでも\nしようかな…", 1, 1, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (102, "次に鍛えるべきは\n肉体面か精神面か\nどちらにしよう…？", 2, 1, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (103, "ツムギが作ってくれた\nこの服…一体\nいつサイズを…？", 3, 1, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (104, "仲間なんていらない\nそう思ってた頃も\nあったな…", 4, 1, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (105, "考えごとをしていると\nつい部屋中を\n歩いてしまうな", 5, 1, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (106, "彼は\nどこまで強くなるのか\n私も負けられないな", 101, 1, 0, 0, 1, 100301, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (107, "私が一本を取られる\nなんてね…願い事は\nもう決まったのかな？", 102, 1, 0, 0, 1, 100301, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (108, "ああ、キミだったのか\n人の気配がしたから\n誰かと思ったよ", 1, 2, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (109, "斬りかかるつもりなら\nちゃんとかかってきて\n…呼んだだけ？", 2, 2, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (110, "なに？　私に相談？\n戦いについてなら\n喜んで", 3, 2, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (111, "今のが突き？\n軽い！　もっと鋭く！\nさあ、もう一回！", 4, 2, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (112, "ひゃっ！　ど、どこを\n触ってるの！？\n…油断した", 101, 2, 0, 0, 1, 100301, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (113, "キミにはこれからも\n私のそばに…\nいや、なんでもない", 102, 2, 0, 0, 1, 100301, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (114, "おはよう\n今日も充実した\n一日にしていこう", 1, 2, 0, 1, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (115, "そろそろ\nお茶の時間か\nキミも一緒にどう？", 2, 2, 0, 2, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (116, "遅くまで大変だね\nまだ仕事があるなら\n手伝おうか？", 3, 2, 0, 3, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (117, "戦いを経てもなお\n美しくあるように…\nこれでよし♪", 1, 3, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (118, "戦ってばかりで\n休まないと、また\nユイに怒られるな", 2, 3, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (119, "ヒヨリみたいに\n練習相手に…\nいや、やめておこう", 3, 3, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (120, "これはいい…\n戦いの前の精神統一に\nもってこいじゃないか", 4, 3, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (121, "時々は落ち着いた\n時間を過ごすのも\n悪くない…", 5, 3, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (122, "彼に負けないよう\n私も更に強くなろう\n共に戦うために！", 6, 3, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (123, "食事は大切だけど\n食べ過ぎには\n注意しておこう…", 7, 3, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (124, "ユイ…！\nこ、こんな本を\n読んでいたのか…！", 8, 3, 0, 0, 1, 100301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (126, "海だけじゃなくて\n川でも釣りがしたいな\n道具も新調しよう", 1, 1, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (127, "ツムギが作ってくれた\nこの服…一体\nいつサイズを…？", 2, 1, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (128, "彼は\nどこまで強くなるのか\n私も負けられないな", 3, 1, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (129, "そろそろ修行の\n内容を新しくしよう\nより厳しいものにね", 4, 1, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (130, "強くなって…誰にも\n妨げられない自由な\n生き方がしたい", 5, 1, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (131, "まさか風邪を引くとは\n彼の看病のおかげで\nすっかり良く\nなったけど", 101, 1, 0, 0, 1, 100302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (132, "私が一本を取られる\nなんてね…願い事は\nもう決まったのかな？", 102, 1, 0, 0, 1, 100302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (133, "どうしたの？\nなんでもない？\nそれなら良かった", 1, 2, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (134, "あんまり突っつくと\nお返しするよ？\n覚悟は出来てる？", 2, 2, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (135, "ねぇ、今度また\n釣りに行かない？\n大きいのを狙おう", 3, 2, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (136, "修行がしたいの？\nそれを早く言ってよ\nすぐに出発しよう！", 4, 2, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (137, "ひょっとして\n今のも一本だなんて\n言わないよね？", 101, 2, 0, 0, 1, 100302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (138, "キミにはこれからも\n私のそばに…\nいや、なんでもない", 102, 2, 0, 0, 1, 100302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (139, "今日は仕事？\nそれとも修行？\n良ければ付き合うよ", 1, 2, 0, 1, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (140, "休息も時には\n必要だと、仲間から\n教わったよ", 2, 2, 0, 2, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (141, "遅くまで大変だね\nまだ仕事があるなら\n手伝おうか？", 3, 2, 0, 3, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (142, "髪の長さを少し\n変えてみようかな…\nわ、私は何を…！", 1, 3, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (143, "休息があってこそ\n万全な状態で\n戦えるんだ", 2, 3, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (144, "ヒヨリみたいに\n練習相手に…\nいや、やめておこう", 3, 3, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (145, "体と同様に\n心もほぐれるね…\nはぁ…", 4, 3, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (146, "休む時は休む\nヒヨリもそろそろ\n覚えて欲しいな…", 5, 3, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (147, "彼に負けないよう\n私も更に強くなろう\n共に戦うために！", 6, 3, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (148, "修行のせいか\n最近食べる量が\n増えてきたような…", 7, 3, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (149, "ユイ…！\nこ、こんな本を\n読んでいたのか…！", 8, 3, 0, 0, 1, 100302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (151, "お宝の予感！\n部屋中を\n探検しちゃうぞ～", 1, 1, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (152, "落とし穴…どこに\n作ったんだっけ？", 2, 1, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (153, "うえ～ん！\n…嘘泣きしたら\n相手は油断するかな", 3, 1, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (154, "ハニートラップって\nすごく甘いお菓子で\nイタズラするのかな？", 4, 1, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (155, "かくれんぼする人\nこの指、と～まれ！", 5, 1, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (156, "ミソギ以外の人に\nイタズラされちゃ\nダメだよ！", 101, 1, 0, 0, 1, 100401, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (157, "ミソギと遊ぶ？\nミソギに遊ばれる？", 102, 1, 0, 0, 1, 100401, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (158, "いいこと思いついた！\nい、イタズラとかじゃ\nないよ～", 1, 2, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (159, "うわっ！？\n　にいちゃんが、\nミソギにイタズラ？", 2, 2, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (160, "にいちゃんの\n通りそうなところに\nバナナの皮を…", 3, 2, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (161, "にいちゃんのオデコと\nホッペと鼻と目と耳に\n落書きを…", 4, 2, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (162, "ここ、ミソギ探検隊の\n基地にしようよ！", 101, 2, 0, 0, 1, 100401, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (163, "だ～れだ…って？\nにいちゃんの声くらい\nわかるよ！\n大好きだもん♪", 102, 2, 0, 0, 1, 100401, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (164, "にいちゃん、おはよ！\n目覚まし時計を\n止めておいたのに、\nよく起きられたね～♪", 1, 2, 0, 1, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (165, "にいちゃんが\n昼寝したら、\nイタズラし放題♪", 2, 2, 0, 2, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (166, "夜の探検も\nおもしろそう！\nねぇ出かけちゃダメ？", 3, 2, 0, 3, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (167, "イタズラには\nお色気も必要…\nうん、完璧！", 1, 3, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (168, "座ったら、ブーッって\nいう音が出たら、\nおもしろいな～♪", 2, 3, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (169, "かわいい！\nミソギ探検隊の\nマスコットにしよう♪", 3, 3, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (170, "吸うとくしゃみが\n止まらなくなるお香を\nここに…くしゅっ！", 4, 3, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (171, "にひひ…イタズラの\n証拠、ここで\n燃やしちゃおう～！", 5, 3, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (172, "探検家は\n体力勝負だよー！", 6, 3, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (173, "みんなに分けて\nあげようかな～\n激辛ソースも\n入れちゃうけどね！", 7, 3, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (174, "こういう所に\n宝の地図が\n隠れてるんだよね～", 8, 3, 0, 0, 1, 100401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (176, "お宝の予感！\n部屋中を\n探検しちゃうぞ～", 1, 1, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (177, "うぅ、探検に出たい！\nじっとしてなんか\nいられないよ～！", 2, 1, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (178, "うえ～ん！\n…嘘泣きしたら\n相手は油断するかな", 3, 1, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (179, "ハニートラップって\nすごく甘いお菓子で\nイタズラするのかな？", 4, 1, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (180, "かくれんぼする人\nこの指、と～まれ！", 5, 1, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (181, "にいちゃんのオデコと\nホッペと鼻と目と耳に\n落書きを…", 101, 1, 0, 0, 1, 100402, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (182, "にいちゃんが喜ぶ\nイタズラ、何かない\nかな～？", 102, 1, 0, 0, 1, 100402, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (183, "ミソギがしかけた\nイタズラ\n見つけられるかな？", 1, 2, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (184, "探検する？\n冒険する？\nそれとも…\nイタズラされる？", 2, 2, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (185, "将来の夢は探検家！\n探したい物はないけど", 3, 2, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (186, "にいちゃんに宿題！\n落とし穴を10個\n掘ること！", 4, 2, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (187, "だ～れだ…って？\nにいちゃんの声くらい\nわかるよ！\n大好きだもん♪", 101, 2, 0, 0, 1, 100402, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (188, "ここ、ミソギ探検隊の\n基地にしようよ！", 102, 2, 0, 0, 1, 100402, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (189, "にいちゃん\n探検に行こうよ！\n今からなら遭難しても\n夜には帰れるよ！", 1, 2, 0, 1, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (190, "にいちゃんが昼寝したら\nイタズラし放題♪", 2, 2, 0, 2, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (191, "夜の探検も\nおもしろそう！\nねぇ出かけちゃダメ？", 3, 2, 0, 3, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (192, "イタズラには\nお色気も必要…\nうん、完璧！", 1, 3, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (193, "ゆっくりまったりして\n次のイタズラを\n考えよ～！", 2, 3, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (194, "かわいい！\nミソギ探検隊の\nマスコットにしよう♪", 3, 3, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (195, "吸うとくしゃみが\n止まらなくなるお香を\nここに…くしゅっ！", 4, 3, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (196, "にひひ…イタズラの\n証拠、ここで\n燃やしちゃおう～！", 5, 3, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (197, "探検家は\n体力勝負だよー！", 6, 3, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (198, "探検のおやつに\nぴったりかも～！", 7, 3, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (199, "こういう所に\n宝の地図が\n隠れてるんだよね～", 8, 3, 0, 0, 1, 100402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (201, "音楽は全部好きだけど\n一番好きなのは\nやっぱりジャズかな", 1, 1, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (202, "はぁ、はぁ…\n一人でもいっぱい\nしないと…\n特訓…", 2, 1, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (203, "お姉ちゃんには\nもっと自信を\n持ってほしいなぁ", 3, 1, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (204, "お姉ちゃんのマネ\nしちゃおうかな？", 4, 1, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (205, "双子って、\n好みのタイプも\n似ちゃうのかな？", 5, 1, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (206, "お兄ちゃんと私は\n相性抜群です♪", 101, 1, 0, 0, 1, 100601, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (207, "もう待ちきれない…\nお兄ちゃん、\n早く帰って来て！", 102, 1, 0, 0, 1, 100601, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (208, "あんっ…着替えよう\nと思ったのに\nお兄ちゃんのエッチ！", 1, 2, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (209, "うふふ、お兄ちゃん！\n今日は何を\nするんですか？", 2, 2, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (210, "そんなところ\n触っちゃダメ♪", 3, 2, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (211, "お兄ちゃん、イジワル\nしないでください…", 4, 2, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (212, "お兄ちゃん、もっと\n上級編のテクニック、\n教えてくださいね！", 101, 2, 0, 0, 1, 100601, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (213, "コーチ、\n今日も特訓\nお願いします！", 102, 2, 0, 0, 1, 100601, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (214, "おはようございます\n昨夜は楽しかった\nですね、うふふ♪", 1, 2, 0, 1, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (215, "こんな明るい時間から\nす、するんですか…\n二人っきりの特訓…", 2, 2, 0, 2, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (216, "夜はこれからですよ\nお兄ちゃん♪", 3, 2, 0, 3, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (217, "世界一、かわいく\nなるんだから♪", 1, 3, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (218, "気持ちいい♪\nもう立てないよ～", 2, 3, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (219, "かわいい♪\nアカリのライバル\nだね", 3, 3, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (220, "はぁ…気持ちいい、\n私、このままダメに\nなっちゃいそう…", 4, 3, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (221, "はぁ…アカリ、\nとろけちゃう…", 5, 3, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (222, "はぁ…はぁはぁ、\n私…もう…ダメ\n限界です…！", 6, 3, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (223, "わぁ、おいしい～\nけど食べ過ぎは美容に\nよくないですよね", 7, 3, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (224, "この楽譜、\nサックスで吹いて\nみたいなぁ♪", 8, 3, 0, 0, 1, 100601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (226, "このごろ一人でいると\nお兄ちゃんのこと\nばかり考えちゃう…", 1, 1, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (227, "はぁ、はぁ…もっと\nいっぱいしなくちゃ\n…練習", 2, 1, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (228, "このお部屋、なんだか\n落ち着きます…\nお兄ちゃんが\nいるから？", 3, 1, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (229, "みんなかわいいな～\n世界一かわいくなる\nのは、難しいな…", 4, 1, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (230, "双子って、\n好みのタイプも\n似ちゃうのかな？", 5, 1, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (231, "いつか世界でいちばん\nかわいくなって\nお兄ちゃんと…", 101, 1, 0, 0, 1, 100602, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (232, "もう待ちきれない…\nお兄ちゃん、\n早く帰って来て！", 102, 1, 0, 0, 1, 100602, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (233, "あんっ…着替えよう\nと思ったのに\nお兄ちゃんのエッチ！", 1, 2, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (234, "二人きりの秘密の特訓\n今度はいつですか？\n待ち遠しいです…", 2, 2, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (235, "え？　ここでするの？\nみんなの前で恥ずか\nしいな…筋トレ", 3, 2, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (236, "お兄ちゃん、イジワル\nしないでください…", 4, 2, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (237, "お兄ちゃんといると\nわ、私…ドキドキ\nしてきちゃう…", 101, 2, 0, 0, 1, 100602, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (238, "コーチ、\n今日も特訓\nお願いします！", 102, 2, 0, 0, 1, 100602, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (239, "おはようございます\n昨夜は楽しかった\nですね、うふふ♪", 1, 2, 0, 1, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (240, "お兄ちゃんに\n食べてもらいたいなぁ\n手作りのお昼ごはん", 2, 2, 0, 2, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (241, "お風呂入ってきますね\nそのあとは…\n二人でい～っぱい\n遊びましょうね", 3, 2, 0, 3, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (242, "お姉ちゃんのマネ\nしちゃおうかな？", 1, 3, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (243, "気持ちいい♪\nもう立てないよ～", 2, 3, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (244, "かわいい♪\nアカリのライバル\nだね", 3, 3, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (245, "はぁ…気持ちいい、\n私、このままダメに\nなっちゃいそう…", 4, 3, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (246, "あったか～い…\nまるでお兄ちゃんが\n隣にいる時みたい", 5, 3, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (247, "汗をかくと\n気持ちいいですよね", 6, 3, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (248, "お兄ちゃんの特訓に\n付き合うために\nたっぷり\n食べておかないと♪", 7, 3, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (249, "この楽譜\nサックスで吹いて\nみたいなぁ♪", 8, 3, 0, 0, 1, 100602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (251, "プリン、プリン、\nプリン、プリン、\nプリン、プリン～♪", 1, 1, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (252, "う～ら～め～し～や～\nなの～♪", 2, 1, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (253, "プリンがないなら\n死んだほうがマシなの\nあ、もう死んでたの～", 3, 1, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (254, "幽霊の正体見たり、\nミヤコなの～", 4, 1, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (255, "ミヤコがいきなり\n消えたら、みんな\n驚くかもなの～♪", 5, 1, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (256, "アイツがいて、\nプリンもある。\nきっとここが天国なの", 101, 1, 0, 0, 1, 100701, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (257, "アイツはプリンセス\nナイトじゃなくて\nプリンナイトなの～", 102, 1, 0, 0, 1, 100701, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (258, "姿を消して、オマエを\n見張ってやるの～\nむふふ～♪", 1, 2, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (259, "もし成仏した先に\nプリンがなかったら\n地獄なの～…", 2, 2, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (260, "右にプリン左にプリン\n後ろにもプリン♪\n前にはオマエなの～！", 3, 2, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (261, "死んだ人には\nお供え物をするの～\nミヤコにも、プリンを\n毎日お供えするの～", 4, 2, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (262, "たくさんオマエと\n遊べて、\n成仏しそうなくらい\nうれしいの～！", 101, 2, 0, 0, 1, 100701, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (263, "オマエのこと\n気に入ったからずっと\nとり憑いてやるの～", 102, 2, 0, 0, 1, 100701, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (264, "う～　眠いの…\n二度目の二度寝を\nするの…", 1, 2, 0, 1, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (265, "お昼ご飯はプリンなの\n３時のおやつも、\nプリンなの～", 2, 2, 0, 2, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (266, "ディナーは豪華に、\nプリンのフルコース\nなの～♪", 3, 2, 0, 3, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (267, "体が透けちゃうから\nうまく使えないの～", 1, 3, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (268, "まったりなの～\nあとはプリンがあれば\n完璧なの～", 2, 3, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (269, "む～…かわいいけど\nプリンは分けて\nあげないの～", 3, 3, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (270, "は～　いい気分なの…\n成仏しそうなの…", 4, 3, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (271, "も、もしかして\nミヤコ、ここで\n火葬されちゃうの？", 5, 3, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (272, "幽霊には、体力も\n筋力も関係ないの～！", 6, 3, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (273, "ぱくぱくモグモグ…\nミヤコ、幽霊だけど、\nお腹はすくの～", 7, 3, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (274, "プリンの写真集が\nあればいいのに\nなの～", 8, 3, 0, 0, 1, 100701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (276, "うらめしや～…\n裏の飯より\nプリンがいいの～", 1, 1, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (277, "プリン♪　プリン♪\nプリン♪　なの～♪　", 2, 1, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (278, "世界中のケーキ屋が\nプリンのおいしさを\n競い合えばいいの～！\n審査員はミヤコなの～", 3, 1, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (279, "買ってきたプリンには\n全部ミヤコの名前を\n書いておくの～", 4, 1, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (280, "プリンがないなら\n死んだほうがマシなの\nあ、もう死んでたの～ ", 5, 1, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (281, "アイツがいて\nプリンもある\nきっとここが天国なの", 101, 1, 0, 0, 1, 100702, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (282, "アイツはプリンセス\nナイトじゃなくて\nプリンナイトなの～", 102, 1, 0, 0, 1, 100702, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (283, "右にプリン左にプリン\n後ろにもプリン♪\n前にはオマエなの～！", 1, 2, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (284, "もし成仏した先に\nプリンがなかったら\n地獄なの～…", 2, 2, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (285, "今日はオマエと\nプリンを買いに行くの\n強制なの～　", 3, 2, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (286, "死んだ人には\nお供え物をするの～\nミヤコにも、プリンを\n毎日お供えするの～", 4, 2, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (287, "たくさんオマエと\n遊べて\n成仏しそうなくらい\nうれしいの～！ ", 101, 2, 0, 0, 1, 100702, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (288, "ミヤコのプリン\nオマエにだったら\n分けてあげるの～ ", 102, 2, 0, 0, 1, 100702, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (289, "う～　眠いの…\n二度目の二度寝を\nするの… ", 1, 2, 0, 1, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (290, "う～ら～め～し～や～\n…明るい時間だと\n驚かせないの～ ", 2, 2, 0, 2, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (291, "ひゅ～どろどろ～ん☆\n真っ暗なうちに\nいたずらしまくるの～♪", 3, 2, 0, 3, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (292, "体が透けちゃうから\nうまく使えないの～ ", 1, 3, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (293, "落ち着くの～\nいまプリン食べたら\nきっといつもより\nおいしいの～♪ ", 2, 3, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (294, "む～…かわいいけど\nプリンは分けて\nあげないの～　", 3, 3, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (295, "は～　いい気分なの…\n成仏しそうなの…", 4, 3, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (296, "も、もしかして\nミヤコ、ここで\n火葬されちゃうの？ ", 5, 3, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (297, "幽霊には、体力も\n筋力も関係ないの～！　", 6, 3, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (298, "おいしいの～\nプリン味だったら\nもっとおいしいの～ ", 7, 3, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (299, "プリンの写真集が\nあればいいのに\nなの～ ", 8, 3, 0, 0, 1, 100702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (301, "もし太陽が滅んでも\nボクの美しさで大地を\n照らしてあげる！", 1, 1, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (302, "う～ん、この部屋には\nボクの肖像画や\n彫像が必要だね", 2, 1, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (303, "美の女神と愛の女神が\nボクを作る時、本気\n出しちゃったんだね♪", 3, 1, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (304, "ボクの誕生とともに\n全ての美しさは過去の\n遺物になったんだよ！", 4, 1, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (305, "うわっ昨日より可愛く\nなってる。明日は\nどうなっちゃう\nのかな？", 5, 1, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (306, "このボクがいるだけで\nあの人への\nおもてなしだよね", 101, 1, 0, 0, 1, 100801, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (307, "ボクの可愛さは、\nふふ…あの人の\nためのものさ", 102, 1, 0, 0, 1, 100801, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (308, "ねぇ～、ボクって\n可愛い？\nふふ、知ってる☆", 1, 2, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (309, "呼んだ？\n可愛いボクと話したい\n気持ちはわかるよ", 2, 2, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (310, "ふふ、ボクに触ると\nキミも美しく\nなっちゃうかもよ？", 3, 2, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (311, "どうかな、\n今日のボク。\n美しい？　可愛い？\nねえ、どっち？", 4, 2, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (312, "あの人も今、\n可愛いボクのこと\n考えてるかな…", 101, 2, 0, 0, 1, 100801, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (313, "美しい…\nキミの瞳に写るボクは\nより一層きれいだ", 102, 2, 0, 0, 1, 100801, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (314, "美しいボクの\n美しい一日が\n始まるよ！", 1, 2, 0, 1, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (315, "さーて、午後からも\n可愛く美しく\n華麗に優雅に♪", 2, 2, 0, 2, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (316, "バラの花びら\nいっぱい浮かべた\nお風呂に入ってから\n寝ようっと♪", 3, 2, 0, 3, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (317, "鏡よ、鏡。この世で\n一番可愛いボクに\nお似合いの人はだれ？", 1, 3, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (318, "ボクが座ったソファは\n「美しいソファ」に\nランクアップした！", 2, 3, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (319, "わあ、可愛い！\n…まあ、ボクほど\nじゃないけどさ！", 3, 3, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (320, "服を羽織るように\n香りをまとうボク…\n美しい、美しすぎる！", 4, 3, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (321, "気安く触ったら\n火傷する…\n炎はボクに似ているね", 5, 3, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (322, "運動は苦手なのに\n運動するボクの姿は\n可愛いなんて…罪♪", 6, 3, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (323, "ボクが食べると、\n食べ物まで\n可愛いなあ…", 7, 3, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (324, "ボクが触った瞬間に、\nこの本は美を\n携えてしまうんだ", 8, 3, 0, 0, 1, 100801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (326, "ボクの美しさは\nみんなのために\nあるんだよ！", 1, 1, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (327, "う～ん、この部屋には\nボクの肖像画や\n彫像が必要だね", 2, 1, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (328, "これ以上美しくなると\nボクをめぐって\n大陸中で戦争が\n始まっちゃう！", 3, 1, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (329, "ボクの誕生とともに\n全ての美しさは過去の\n遺物になったんだよ！", 4, 1, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (330, "ボクの可愛さについて\nみんな話し合わない\nのかな…？", 5, 1, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (331, "このボクがいるだけで\nあの人への\nおもてなしだよね", 101, 1, 0, 0, 1, 100802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (332, "あの人も今\n可愛いボクのこと\n考えてるかな…", 102, 1, 0, 0, 1, 100802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (333, "美の女神と愛の女神が\nボクを作る時、本気\n出しちゃったんだね♪", 1, 2, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (334, "ボクの美しさに嫉妬\nしたって意味ないよね\n次元が違うんだから", 2, 2, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (335, "ボクの化粧品使う？\n一緒に可愛くなろうよ", 3, 2, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (336, "ボクがいるだけで\nこの部屋は美の神殿♪\nランドソルの新たな\n観光名所になるね！", 4, 2, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (337, "呼んだ？\n可愛いボクと話したい\n気持ちはわかるよ", 101, 2, 0, 0, 1, 100802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (338, "美しい…\nキミの瞳に写るボクは\nより一層綺麗だ", 102, 2, 0, 0, 1, 100802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (339, "朝日と共に\nボクの美しさも\n周りを照らすよ", 1, 2, 0, 1, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (340, "ボクの美しさを\n維持するために\nお昼ご飯食べなくちゃ", 2, 2, 0, 2, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (341, "バラの花びらいっぱい\n浮かべたお風呂に\n入ってから\n寝ようっと♪", 3, 2, 0, 3, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (342, "鏡よ、鏡。この世で\n一番可愛いボクに\nお似合いの人はだれ？", 1, 3, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (343, "ボクが座ったソファは\n「美しいソファ」に\nランクアップした！", 2, 3, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (344, "可愛いものを\n可愛いって言える\nボクって可愛いよね！", 3, 3, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (345, "服を羽織るように\n香りをまとうボク…\n美しい、美しすぎる！", 4, 3, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (346, "冷えは美容の大敵\nなんだから！\nここ、ボクの場所ね！", 5, 3, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (347, "運動は苦手なのに\n運動するボクの姿は\n可愛いなんて…罪♪", 6, 3, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (348, "ボクが食べると\n食べ物まで\n可愛いなあ…", 7, 3, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (349, "ボクが触った瞬間に\nこの本は美を\n携えてしまうんだ", 8, 3, 0, 0, 1, 100802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (351, "「第１０部２０章\n終焉戦争、開幕」\n…これでよし！", 1, 1, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (352, "今度シグルドに\n私の魔法を一つ\n伝授してやるか", 2, 1, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (353, "ここでは風が\n吹いてこないな…\n換気したい！", 3, 1, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (354, "そうだ、ナナカに\nこの間借りた本を\n返さないと…", 4, 1, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (355, "まずは包帯をとって\n手から龍の形の\n炎を出して…", 5, 1, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (356, "シグルド…\n今頃何処で何を\nしているのだろう…", 101, 1, 0, 0, 1, 100901, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (357, "最近、彼の姿が\nまぶしく見える…\nどうして…？", 102, 1, 0, 0, 1, 100901, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (358, "辞書を知らないか？\n…探している\n理由は聞くな", 1, 2, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (359, "そうだ！\n貴様の技にも\n名前をつけてやろう！", 2, 2, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (360, "私に触れても力を\n奪われないのは\n貴様くらいだぞ？", 3, 2, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (361, "何事だ？\nまさか我が瞳に\n魅入られたのか？", 4, 2, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (362, "貴様がそばにいると\nとても安心できる…\n…不思議だ", 101, 2, 0, 0, 1, 100901, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (363, "い、いきなり目の前に\n現れるな！　ドキドキ\nするだろうがぁ！", 102, 2, 0, 0, 1, 100901, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (364, "「覚醒」めたか…\n行くぞ、悪を討つ\n戦いに出発だ！", 1, 2, 0, 1, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (365, "昼間は「ヤツら」も\n襲ってはこない…\n束の間の休息だ", 2, 2, 0, 2, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (366, "どうした？　夜はまだ\nこれから…ふぁ…\nね、眠くなどないぞ！", 3, 2, 0, 3, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (367, "何か足りないな…\n暗黒騎士の紋章を\n作ろうかな", 1, 3, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (368, "くっ…！\n私を眠りの国へ\n誘うつもりか！", 2, 3, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (369, "このようなものに\n懐柔されるものか！\n…されるものか！", 3, 3, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (370, "これを使えば\nもっとそれっぽい\n雰囲気が出そうだ", 4, 3, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (371, "これが我らの求めた\n安寧か…\n悪くない…", 5, 3, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (372, "この程度\n前世での激闘に\n比べれば…！", 6, 3, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (373, "最近金欠でな…\nいやぁありがたい…", 7, 3, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (374, "ここにも\n前世の記憶が\n眠っていたとは…", 8, 3, 0, 0, 1, 100901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (376, "「第１３部１章\n閃光のシグルド」\n…ついに登場だな", 1, 1, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (377, "何故だ…何故\nこうもあっさり金欠に\n逆戻りするのだ！？", 2, 1, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (378, "やはり転生者という\n設定はカッコイイ…\n天才だな、私！", 3, 1, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (379, "そうだ、ナナカに\nこの間借りた本を\n返さないと…", 4, 1, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (380, "そろそろ今日の分の\n魔力を溜めないと\nまた魔力切れが…", 5, 1, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (381, "最近奴がそばに\nいるだけで、鼓動が\n早くなるのは何故だ？", 101, 1, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (382, "シ、シグルド…！\nだめだ…妄想でも\n上手く言えない…", 102, 1, 0, 0, 1, 100902, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (383, "なんだ？　新たな\n賞金の情報を\n持ってきたのか？", 1, 2, 0, 0, 1, 100902, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (384, "名乗りやポーズは\nその強度で相手を\n圧倒する技術だ", 2, 2, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (385, "いいか、魔法の\n詠唱中は絶対に\n声をかけるなよ？", 3, 2, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (386, "おお、ちょうど今\n貴様専用の設定集を\n作成中だぞ！", 4, 2, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (387, "貴様がそばにいると\nとても安心できる…\n…不思議だ", 101, 2, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (388, "い、いきなり目の前に\n現れるな！　ドキドキ\nするだろうがぁ！", 102, 2, 0, 0, 1, 100902, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (389, "夜更かしのせいか\nまだ眠気が…いや！\nこれは組織の罠だ！", 1, 2, 0, 1, 1, 100902, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (390, "平穏な時に\n出来るだけ魔力を\n溜めておかねば…", 2, 2, 0, 2, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (391, "夜になると、力が\n増した気分になるな\n…なりませんか？", 3, 2, 0, 3, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (392, "何か足りないな…\n暗黒騎士の紋章を\n作ろうかな", 1, 3, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (393, "お、おのれ\nヒュプノス…\n私は負けないぞ…", 2, 3, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (394, "くっくっくっ…\n貴様は特別団員に\nしてやろう", 3, 3, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (395, "これを使えば\nもっとそれっぽい\n雰囲気が出そうだ", 4, 3, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (396, "これが我らの求めた\n安寧か…\n悪くない…", 5, 3, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (397, "新たな戦いに備えて\n魔力だけでなく\n体力も鍛えねば！", 6, 3, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (398, "食事は魔力に\n変換する体力の\n元になるのだ！", 7, 3, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (399, "フフフ…\nこれを覚えれば\nもっと強く…！", 8, 3, 0, 0, 1, 100902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (401, "王子はんほんまに\nはんなりしてて、\n王子はんって感じやわ", 1, 1, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (402, "この絵本の王子はん、\n王子はんみたいで\nええなぁ♪", 2, 1, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (403, "うちがガラスの靴を\n落としたら、王子はん\n見つけてくれるやろか", 3, 1, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (404, "マホマホ王国\n次期国王の王子はん\n…見てみたいわ～", 4, 1, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (405, "王子はんのために\n糸を紡いで、\n編み物でもしまひょか", 5, 1, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (406, "マホ姫と王子はん、\n絵本の世界より\nベストカップルや", 101, 1, 0, 0, 1, 101001, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (407, "王子はんと\n一緒にいると\n胸がせわしのー\nうごいてかなん", 102, 1, 0, 0, 1, 101001, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (408, "うちら並んでたら\nお雛様みたいに\n見えると思いまへん？", 1, 2, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (409, "王子はんを\n国に連れて帰ったら\nみんな大歓迎して\nくれるやろなぁ", 2, 2, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (410, "王子はんは、\n絵本から出てきた人\nみたいやね～", 3, 2, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (411, "うちの話し方\nのんびりしてます\nやろか？", 4, 2, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (412, "マホ姫の手は\nつべたいから、\n王子はんが温めて？", 101, 2, 0, 0, 1, 101001, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (413, "うちがもし悪い魔法に\nかかったら、王子はん\n口づけしてくれはる？", 102, 2, 0, 0, 1, 101001, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (414, "朝は小鳥はんも\nおなかがすいてるから\nよう飛び回りはるねえ", 1, 2, 0, 1, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (415, "お茶請けはお大福が\nよろしおすけど\nクッキーもええなあ", 2, 2, 0, 2, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (416, "うち、普段から\n夢見がちやけど…\nほんに眠い時間やわぁ", 3, 2, 0, 3, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (417, "王子はんに\n会いに行くなら、\nおめかしせな\nあかんなぁ", 1, 3, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (418, "はんなりした\nええお椅子やわぁ\nほっこりしますなあ", 2, 3, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (419, "かいらしもんが\nいっぱいで、\nマホマホ王国みたい\nやわぁ", 3, 3, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (420, "心地ええどす。まるで\nお花畑にいるようやね", 4, 3, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (421, "ぽかぽかどす。\n心まであったかく\nなりますわぁ", 5, 3, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (422, "はぁはぁ、お姫はんは\n激しい運動は\nしぃひんもんどす～", 6, 3, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (423, "もぐもぐ…あんまり\n速う食べられへんけど\n美味しいわぁ", 7, 3, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (424, "絵本、絵本～\n幸せやわぁ♪", 8, 3, 0, 0, 1, 101001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (426, "王子はんにとって\n自慢の姫になるえ～", 1, 1, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (427, "カボチャの馬車に\nガラスの靴…\n欲しいなぁ", 2, 1, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (428, "うちがガラスの靴を\n落としたら、王子はん\n見つけてくれるやろか", 3, 1, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (429, "マホマホ王国\n次期国王の王子はん\n…見てみたいわ～", 4, 1, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (430, "ほんまなぁ\nこの絵本が面白いんよ\n王子はんに\n読んであげよ", 5, 1, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (431, "マホ姫と王子はん\n絵本の世界より\nベストカップルや", 101, 1, 0, 0, 1, 101002, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (432, "王子はんと\n一緒にいると\n胸がせわしのー\nうごいてかなん", 102, 1, 0, 0, 1, 101002, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (433, "たまには、王子はんの\n好きな絵本も\n知りたいな～", 1, 2, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (434, "王子はんを\n国に連れて帰ったら\nみんな大歓迎して\nくれるやろなぁ", 2, 2, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (435, "そのうち、王子はんの\nお国にも連れてって\nもらえますやろか？", 3, 2, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (436, "絵本読むんも\nええなぁ…", 4, 2, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (437, "うちがもし悪い魔法に\nかかったら、王子はん\n口づけしてくれはる？", 101, 2, 0, 0, 1, 101002, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (438, "うちら並んでたら\nお雛様みたいに\n見えると思いまへん？", 102, 2, 0, 0, 1, 101002, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (439, "朝は小鳥はんも\nおなかがすいてるから\nよう飛び回りはるねえ", 1, 2, 0, 1, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (440, "マホマホ王国では\nこの時分は\nみんなお昼寝\nしてたんよ", 2, 2, 0, 2, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (441, "夜に飛んだり鳴いたり\nする鳥はんもおるんよ\n昼は寝てはるんかねぇ", 3, 2, 0, 3, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (442, "王子はんに\n会いに行くなら\nおめかしせな\nあかんなぁ", 1, 3, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (443, "王子はんも一緒に\nゆっくりしていっても\nええんよ？", 2, 3, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (444, "かいらしい子やねぇ\nうちとお友だちに\nなってくれるん？", 3, 3, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (445, "癒しアイテムって\nほんま、好っきゃわぁ", 4, 3, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (446, "うちのお城にも\nほしいわぁ。帰ったら\nさっそく準備せな\nあかんなぁ", 5, 3, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (447, "部屋の中で運動\nできるのも、なかなか\n面白いもんやわぁ", 6, 3, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (448, "おいひいわ～\nマホマホ王国には\nない味やわぁ", 7, 3, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (449, "しっかり知識を\n身につけんと\n魔法も使えへん\nからなぁ", 8, 3, 0, 0, 1, 101002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (451, "１、２、３、４…\nあれ？　いま、\n何段目まで\n編んだっけ？", 1, 1, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (452, "おやつのケーキは\n苺かチョコ…\nどっちも食べよう！", 2, 1, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (453, "い、いけない！\n縫い針落としちゃった", 3, 1, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (454, "ケーキをクレープで\n巻いたら…\n大ヒット商品の予感！", 4, 1, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (455, "「どうだ！妹暮らし」\nってことわざ\nなかったっけ？", 5, 1, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (456, "お兄ちゃんに、\nお洋服でも\n作ろうかな？", 101, 1, 0, 0, 1, 101101, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (457, "ここがお兄ちゃんの\n部屋…\nドキドキしちゃう～", 102, 1, 0, 0, 1, 101101, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (458, "ねぇ、おにいちゃん\n一緒に、スイーツでも\n食べにいかない？", 1, 2, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (459, "クリームついてた！？\nさっき食べた、\nケーキかも…！", 2, 2, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (460, "勉強、見てくれるん\nですか？　やった～♪", 3, 2, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (461, "服がほつれてますよ？\n直してあげます！", 4, 2, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (462, "私をお嫁さんに\nしたいなら、予約は\nお早目に、ですよ♪", 101, 2, 0, 0, 1, 101101, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (463, "ねぇねぇお兄ちゃん！\n…えへへ、\n呼んでみただけ♪", 102, 2, 0, 0, 1, 101101, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (464, "今日も１日\n勉強がんばります！\n…少しは遊ぼうかな", 1, 2, 0, 1, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (465, "お昼休憩に\n甘いものが\n食べたいです～", 2, 2, 0, 2, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (466, "ねむいです～\nでももうちょっと\n勉強しないと～…", 3, 2, 0, 3, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (467, "この服、かわいい♪\n今度作って\nみよっと～！", 1, 3, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (468, "勉強で疲れたから\n休憩しよ～っと", 2, 3, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (469, "かわいい♪\n私が服を作って\nあげよっか？", 3, 3, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (470, "リラックスできます～\nお兄ちゃんが隣に\nいるみたい！", 4, 3, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (471, "のんびりしたら、\nまた勉強しよっと！", 5, 3, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (472, "運動すると勉強も\nはかどるよね！", 6, 3, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (473, "おいし～！\nお兄ちゃんにも\nおすそ上げしますね！", 7, 3, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (474, "お兄ちゃんの記憶を\n戻す方法、どこかに\n書いてないかな？", 8, 3, 0, 0, 1, 101101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (476, "ケーキの食べ過ぎで\nお腹が…うぅ、\n因果横暴だよー…", 1, 1, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (477, "１、２、３、４…\nあれ？　いま、\n何段目まで\n編んだっけ？", 2, 1, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (478, "い、いけない！\n縫い針落としちゃった", 3, 1, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (479, "笑う時には服着ます！", 4, 1, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (480, "「どうだ！妹暮らし」\nってことわざ\nなかったっけ？", 5, 1, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (481, "お兄ちゃんに、\nお洋服でも\n作ろうかな？", 101, 1, 0, 0, 1, 101102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (482, "お兄ちゃんが帰って\nきたら、何して遊ぼう\nかな～？", 102, 1, 0, 0, 1, 101102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (483, "勉強、見てくれるん\nですか？　やった～♪", 1, 2, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (484, "クリームついてた！？\nさっき食べた、\nケーキかも…！", 2, 2, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (485, "おにいちゃん！\nそろそろ、おやつに\nしませんか？", 3, 2, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (486, "勉強は…\n明日にしようっと", 4, 2, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (487, "妹だけど、大人な\nレディですからね！", 101, 2, 0, 0, 1, 101102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (488, "な、ナデナデとか\n恥ずかしいな～", 102, 2, 0, 0, 1, 101102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (489, "今日も１日\n勉強がんばります！\n…少しは遊ぼうかな", 1, 2, 0, 1, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (490, "お昼休憩に\n甘いものが\n食べたいです～", 2, 2, 0, 2, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (491, "お兄ちゃんは\n夜強いんですね\n私は眠くて…", 3, 2, 0, 3, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (492, "服装や髪形が変わると\n気分も変わるよね", 1, 3, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (493, "ここで寝ちゃったら\n受験勉強が～…\nぐーー", 2, 3, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (494, "かわいい♪\n私が服を作って\nあげよっか？", 3, 3, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (495, "いまならどんな試験も\n合格できそうです！", 4, 3, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (496, "のんびりしたら\nまた勉強しよっと！", 5, 3, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (497, "お兄ちゃんを\n守るためには\n毎日、鍛えなくちゃ！", 6, 3, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (498, "おいし～！\nお兄ちゃんにも\nおすそ上げしますね！", 7, 3, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (499, "この本の服\nかわいいなぁ♪\n私に作れるかな？", 8, 3, 0, 0, 1, 101102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (501, "う～ん、今なら\nどこでだって\n眠れちゃいそう…", 1, 1, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (502, "たくさん寝すぎて、\n夢の中か現実か\nわかんなく\nなっちゃうんだよね～", 2, 1, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (503, "…はっ！？\nね、寝てないよ？\nホントだよっ", 3, 1, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (504, "ぐっすり眠って\nパワーを\nフルチャージっ☆", 4, 1, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (505, "もし、超能力のことが\nバレたら…ブルブル", 5, 1, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (506, "テレパシーで\nキミの心を覗けたら\n…なんてね！", 101, 1, 0, 0, 1, 101201, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (507, "キミを抱き枕に…\nじょ、冗談冗談！", 102, 1, 0, 0, 1, 101201, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (508, "ん～、なになに？\n一緒にお昼寝する？", 1, 2, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (509, "忘れ物しちゃった。\nま、いっか！\nえ、ダメ？", 2, 2, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (510, "おおっ、相談ごと？\nなにかな\nなにかな～？", 3, 2, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (511, "う～ん、もしかして\nキミにも仲良しになる\n超能力があるのかも！", 4, 2, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (512, "むむ～…どう？\nテレパシーで、私の\n気持ちを送ったよ！", 101, 2, 0, 0, 1, 101201, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (513, "えっ？　私とキミとの\n相性？　むむ～…\nうん、バッチリだよ☆", 102, 2, 0, 0, 1, 101201, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (514, "まだこんな時間？\nベッドに行って、\n二度寝しなくちゃ～", 1, 2, 0, 1, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (515, "適度なお昼寝は\n健康にいいんだって！\n８時間くらいかな？", 2, 2, 0, 2, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (516, "どんなにお昼寝しても\n夜は眠いんだ～", 3, 2, 0, 3, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (517, "ん～、また寝癖…\nいっつも\n寝てるからかなぁ？", 1, 3, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (518, "一休み、一休み…\nどうせなら百休み\nくらいしようかな…", 2, 3, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (519, "これ…可愛い！\nシオリンに\n届けてあげたい！", 3, 3, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (520, "ん～…気分爽快！\nそれじゃ、おやすみ～\n…すやぁ…", 4, 3, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (521, "気持ちいい…\nはっ！　ダメダメ！\nまた寝るとこだった！", 5, 3, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (522, "眠くならないように、\n運動しよっと！", 6, 3, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (523, "お腹いっぱいになると\n眠くなるよね～", 7, 3, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (524, "睡眠学習って\n本を読みながら\n寝るんだっけ？", 8, 3, 0, 0, 1, 101201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (526, "う～ん、今なら\nどこでだって\n眠れちゃいそう…", 1, 1, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (527, "もっといっぱい\n超能力使えたら\nいいのにな～", 2, 1, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (528, "ねえねえ、\n今から人助け、\n付き合ってほしいなー", 3, 1, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (529, "ぐっすり眠って\nパワーを\nフルチャージっ☆", 4, 1, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (530, "人助け、頑張ったら\nなんだか、眠く…\n…はっ、ダメダメ！", 5, 1, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (531, "キミと一緒なら、\nなんだって出来る！\n間違いない！", 101, 1, 0, 0, 1, 101202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (532, "キミを抱き枕に…\nじょ、冗談冗談！", 102, 1, 0, 0, 1, 101202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (533, "忘れ物しちゃった\nま、いっか！\nえ、ダメ？", 1, 2, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (534, "なに？　困ってる？\nちょうど良かった！\n今は体力満タンだよ☆", 2, 2, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (535, "一緒に\nお出かけしたいなー\nデートしよっ！", 3, 2, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (536, "うんうん、そうだねっ\n困ってる人がいたら\n見過ごせないよねっ！", 4, 2, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (537, "むむ～…どう？\nテレパシーで、私の\n気持ちを送ったよ！", 101, 2, 0, 0, 1, 101202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (538, "う～だんだん眠く…\nねぇ一緒に寝よ？", 102, 2, 0, 0, 1, 101202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (539, "キミって早起きだね！\n私は寝ようかな～", 1, 2, 0, 1, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (540, "適度なお昼寝は\n健康にいいんだって！\n８時間くらいかな？", 2, 2, 0, 2, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (541, "どんなにお昼寝しても\n夜は眠いんだ～", 3, 2, 0, 3, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (542, "ん～、また寝癖…\nいっつも\n寝てるからかなぁ？", 1, 3, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (543, "一休み、一休み…\nどうせなら百休み\nくらいしようかな…", 2, 3, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (544, "これ…可愛い！\nシオリンに\n届けてあげたい！", 3, 3, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (545, "ん～…気分爽快！\nそれじゃ、おやすみ～\n…すやぁ…", 4, 3, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (546, "うう～ん、なんだか\nいつもより眠ーく\nなってきたよ…", 5, 3, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (547, "よーし\n困ってる人のために\nパワーアップ☆", 6, 3, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (548, "食べてすぐ寝ると\n牛になるんだっけ？\nまぁ、いいかぁ～", 7, 3, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (549, "睡眠学習って\n本を読みながら\n寝るんだっけ？", 8, 3, 0, 0, 1, 101202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (551, "モデルは楽しいよ！\nファンの子みんな\n応援してくれるしー！", 1, 1, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (552, "今日のおやつは\n駄菓子に決定～！\nいただきまーす！", 2, 1, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (553, "んー、今日のおやつは\n何にしよう？\nやっぱアメ玉かな！", 3, 1, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (554, "ここで撮影会、\nしようかな～♪", 4, 1, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (555, "７かける８はぁ\n７＋７＋７＋７＋…\nん、何個数えたっけ？", 5, 1, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (556, "やば…\nこのままじゃ、うち\nキュン死にかも…", 101, 1, 0, 0, 1, 101601, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (557, "好きなことして\nヒデサイもいて\nうちって超～\nリア充だよね♪", 102, 1, 0, 0, 1, 101601, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (558, "うちの写真撮るの？\nどんなポーズ？", 1, 2, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (559, "ネイルの勉強中～♪\nうまくなったら、\nヒデサイにしてあげる", 2, 2, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (560, "宿題見てくんない？\nひとりじゃムリ～", 3, 2, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (561, "みてこのネイル♪\n超エモくな～い？\nヒデサイもする～？", 4, 2, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (562, "新しい美容液で\n肌まじスベスベ～\nヒデサイも\n触ってみる？", 101, 2, 0, 0, 1, 101601, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (563, "ヒデサイと会ってると\n顔熱くなるんだよね\n熱なんかないのに…", 102, 2, 0, 0, 1, 101601, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (564, "早起きとか\nつらたんだよねー\n昼すぎまで寝てたい", 1, 2, 0, 1, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (565, "撮影にむけて\nダイエットちうだから\nお昼ぬいてるんだー", 2, 2, 0, 2, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (566, "お腹すいたー\nでもこの時間に\n食べたら絶対に\n太るやつだよねー", 3, 2, 0, 3, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (567, "どんなシーンにも合う\nきれいめわがまま\nちゃんとコーデだよ♪", 1, 3, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (568, "ちょっち疲れたかも？\nガン寝しちゃおっかな", 2, 3, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (569, "きゃわたーん☆\n君もおしゃれしよっか", 3, 3, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (570, "いいにおいじゃん！\nこれと同じにおいの\n香水ないかな？", 4, 3, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (571, "あったまるー\nこれ、サイツヨに\n癒しじゃない？", 5, 3, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (572, "あはは、なんか\nウォーキングの練習\nしてるみたーい！", 6, 3, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (573, "体形維持しないと\nいけないけど\nついつい食べちゃう！", 7, 3, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (574, "全然読めない～\nそだ、ヒデサイに\n読んでもらおっと！", 8, 3, 0, 0, 1, 101601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (576, "そろそろ\n仕事の時間だ～\n出かける準備\nしよっと！", 1, 1, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (577, "今日のおやつは\n駄菓子に決定～！\nいただきまーす！", 2, 1, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (578, "ヒデサイを見習って\nうちも少し勉強して\nみよっかな…　", 3, 1, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (579, "体形維持とか\n気にしてるんだよ～", 4, 1, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (580, "７かける８はぁ\n７＋７＋７＋７＋…\nん、何個数えたっけ？", 5, 1, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (581, "やば…\nこのままじゃ、うち\nキュン死にかも…　", 101, 1, 0, 0, 1, 101602, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (582, "ヒデサイと会ってると\n顔熱くなるんだよね\n熱なんかないのに…", 102, 1, 0, 0, 1, 101602, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (583, "うちの写真撮るの？\nどんなポーズ？", 1, 2, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (584, "ネイルの勉強中～♪\nうまくなったら、\nヒデサイに\nしてあげる♪", 2, 2, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (585, "この雑誌の服\nガチめにほしぃ～", 3, 2, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (586, "うちのコーデで\nヒデサイをオシャンに\nしてあげるね♪", 4, 2, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (587, "新しい美容液で\n肌まじスベスベ～\nヒデサイも\n触ってみる？", 101, 2, 0, 0, 1, 101602, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (588, "好きなことして\nヒデサイもいて\nうちって超～\nリア充だよね♪", 102, 2, 0, 0, 1, 101602, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (589, "今日は早起き\nできたんだー\nメイクもばっち\nきまってるっしょ？", 1, 2, 0, 1, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (590, "撮影にむけて\nダイエットちうだから\nお昼ぬいてるんだー", 2, 2, 0, 2, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (591, "お腹すいたー\nでもこの時間に\n食べたら絶対に\n太るやつだよねー", 3, 2, 0, 3, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (592, "この服ね～\n今年のトレンドなんだ♪\nかわたんでしょ！", 1, 3, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (593, "ちょっち疲れたかも？\nガン寝しちゃおっかな", 2, 3, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (594, "うわー\nこのぬいぐるみ\nもきゅすぎでしょ～！", 3, 3, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (595, "いいにおーい♪\nファンのみんなにも\n教えてあげよー♪", 4, 3, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (596, "あったまるー\nこれ、サイツヨに\n癒しじゃない？", 5, 3, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (597, "食べた分は\n消費しないとね～", 6, 3, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (598, "体形維持しないと\nいけないけど\nついつい食べちゃう！", 7, 3, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (599, "全然読めない～\nそだ、ヒデサイに\n読んでもらおっと！", 8, 3, 0, 0, 1, 101602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (601, "やっさー\n踊ってると、どんどん\n楽しくなるさー！", 1, 1, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (602, "このお菓子、でーじ\nおいしいねー！\nキミも食べる？", 2, 1, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (603, "ハイターイ！　元気な\nあいさつが一番さ～！", 3, 1, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (604, "あまった食材があれば\nチャンプルーにして\n食べたいさー！ ", 4, 1, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (605, "さぁ、みんなで歌って\n踊るさ～♪", 5, 1, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (606, "毎日、最高に幸せさ～\nキミのおかげだねー", 101, 1, 0, 0, 1, 101701, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (607, "キミへの気持ちを\n踊りで表現\nしてみるさ～", 102, 1, 0, 0, 1, 101701, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (608, "海でひと泳ぎ\nしたいさ～\nキミもどう？", 1, 2, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (609, "あぎひゃっ！\n急に声かけたら、\nビックリするさ～", 2, 2, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (610, "踊りなら、\n私が手とり足とり\n教えてあげるさ～！", 3, 2, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (611, "空手の型の\n練習するさー\nキミもどう？", 4, 2, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (612, "よ～し、手をつないで\n踊るさ～！\n恥ずかしがること\nないさ～", 101, 2, 0, 0, 1, 101701, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (613, "キミと一緒だから、\n毎日楽しいこと\nばっかりさー", 102, 2, 0, 0, 1, 101701, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (614, "ハイターイ！\n今日も一日、\nがんばるさー！", 1, 2, 0, 1, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (615, "午後も頑張るために\nお昼ご飯は\nてびちにするさー！", 2, 2, 0, 2, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (616, "故郷では見えない星が\n見られるんだねえ。\nなんか不思議さぁ", 3, 2, 0, 3, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (617, "夢中で踊ってたら、\n髪の毛ぼさぼさに\nなってるさ～！？", 1, 3, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (618, "よく食べてよく踊って\nよく休む。\nそれが元気の秘訣さ～", 2, 3, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (619, "ちゅらかーぎーねー！\nキミはどこから\n来たのー？", 3, 3, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (620, "いい香り～、って\n私もカオリだったさ！\nなんだか照れるね☆", 4, 3, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (621, "故郷はあんまり暖房を\n使わなかったから、\n新鮮さー！", 5, 3, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (622, "汗をかくのは\n気持ちいいさー！\nどんどん行くよー！", 6, 3, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (623, "うーん、おいしいさ～\nゴーヤっぽいものを\n混ぜたいさ～", 7, 3, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (624, "おおー、故郷の民話！\nこんなとこで見るとは\n懐かしいさぁ～！", 8, 3, 0, 0, 1, 101701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (626, "焦らなくても\nなんくるないさ～\nなるようになるさ～", 1, 1, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (627, "さぁ、みんなで歌って\n踊るさ～♪", 2, 1, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (628, "元気がないときは\n私のところに来るさー", 3, 1, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (629, "あまった食材があれば\nチャンプルーにして\n食べたいさー！ ", 4, 1, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (630, "ノリノリな音楽と\n踊りで、疲れを\n吹き飛ばすさ～！", 5, 1, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (631, "毎日、最高に幸せさ～\nキミのおかげだねー", 101, 1, 0, 0, 1, 101702, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (632, "幸せすぎて踊らずには\nいられないさ～", 102, 1, 0, 0, 1, 101702, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (633, "海でひと泳ぎ\nしたいさ～\nキミもどう？", 1, 2, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (634, "ん？　どうしたの～？\nヒマなら一緒に\n踊ろうさ～", 2, 2, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (635, "キミと一緒だから\n毎日楽しいこと\nばっかりさー", 3, 2, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (636, "ハイターイ！　元気な\nあいさつが一番さ～！", 4, 2, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (637, "キミと踊ってる時が\n一番幸せさ～\nキミもそう思ってたら\nうれしいさ～", 101, 2, 0, 0, 1, 101702, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (638, "海に沈む夕日は\nとっても綺麗さ～！\n今度一緒に見ようね～ ", 102, 2, 0, 0, 1, 101702, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (639, "気持ちのいい朝さー！\nひとっ走り\nしてくるさー！", 1, 2, 0, 1, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (640, "午後も頑張るために\nお昼ご飯は\nてびちにするさー！ ", 2, 2, 0, 2, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (641, "故郷では見えない星が\n見られるんだねえ\nなんか不思議さぁ ", 3, 2, 0, 3, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (642, "夢中で踊ってたら\n髪の毛ぼさぼさに\nなってるさ～！？", 1, 3, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (643, "よく食べてよく踊って\nよく休む\nそれが元気の秘訣さ～", 2, 3, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (644, "ちゅらかーぎーねー！\nキミはどこから\n来たのー？ ", 3, 3, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (645, "いい香り～、って\n私もカオリだったさ！\nなんだか照れるね☆ ", 4, 3, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (646, "故郷はあんまり暖房を\n使わなかったから\n新鮮さー！", 5, 3, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (647, "徹夜で踊り続ける\nためにも、まずは\n体を鍛えるさ～", 6, 3, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (648, "もぐもぐ…もっと\nおかわりがほしいさー", 7, 3, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (649, "おおー、故郷の民話！\nこんなとこで見るとは\n懐かしいさぁ～！ ", 8, 3, 0, 0, 1, 101702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (651, "はあ…\nすてきな小説だった～\nキュンキュンしちゃう", 1, 1, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (652, "このお部屋\n女の子ばかりね。\n魔族の女子校を\n思い出しちゃう♪", 2, 1, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (653, "次のテスト\n恋愛小説から\n出題したら\nダメかしら…？", 3, 1, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (654, "キンコンカンコ～ン♪\n授業をはじめま～す", 4, 1, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (655, "はー…\nちょっと肩が\nこっちゃった…", 5, 1, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (656, "私、あの子のこと\n無意識に特別扱い\nしちゃってるかな…", 101, 1, 0, 0, 1, 101801, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (657, "物語だと生徒が先生を\n好きになるのにな…\n逆の場合は…", 102, 1, 0, 0, 1, 101801, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (658, "あん！　見ちゃダメよ\n明日のテストの問題を\n作ってるとこなの！", 1, 2, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (659, "勉強勉強で\n疲れたよね？\n膝枕してあげる！", 2, 2, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (660, "テストがんばったね～\nご褒美に先生が\n特別な授業\nしてあげるね？", 3, 2, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (661, "学院の外でも\n私は君の先生よ\nなんでも聞いてね♪", 4, 2, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (662, "今読んでるのは\nヒロインが年下の子と\n恋に落ちる話…あ、\n深い意味はないのよ～", 101, 2, 0, 0, 1, 101801, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (663, "生徒は全員可愛いけど\n君は少し特別…\nみんなには内緒よ？", 102, 2, 0, 0, 1, 101801, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (664, "学校に\n遅刻しないように\n早く準備しないとね", 1, 2, 0, 1, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (665, "男の子といっしょに\nお弁当を食べるの、\n夢なんだ～", 2, 2, 0, 2, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (666, "明日の予習はやった？\n先生も手伝うから\n寝る前にやりましょ♪", 3, 2, 0, 3, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (667, "もしかして…\n少し露出多いかしら？", 1, 3, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (668, "リラックスすると\nα波が出て、勉強が\nはかどるんですって", 2, 3, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (669, "かわいい♪　あなたも\n私の生徒になる？", 3, 3, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (670, "学院にもこういう\n安らぐ設備が\n必要かしらね？", 4, 3, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (671, "まだ寒いわぁ\n誰か隣に\n来てくれたら…", 5, 3, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (672, "運動部の顧問も\nできるかしら？", 6, 3, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (673, "学校の給食でも\n食べたいわぁ～", 7, 3, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (674, "いい参考書を\n見つけちゃった♪", 8, 3, 0, 0, 1, 101801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (676, "私の生徒に\n不良なんていないわ\nみーんないい子♪", 1, 1, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (677, "このお部屋\n女の子ばかりね\n魔族の女子校を\n思い出しちゃう♪", 2, 1, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (678, "あの子、まだかな…\n宿題も見てあげたいし\n早く来ないかしら？", 3, 1, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (679, "はあ…\nすてきな小説だった～\nキュンキュンしちゃう", 4, 1, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (680, "学校の図書室に\n恋愛小説を\n置いて欲しいなあ", 5, 1, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (681, "私、あの子のこと\n無意識に特別扱い\nしちゃってるかな…", 101, 1, 0, 0, 1, 101802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (682, "物語だと生徒が先生を\n好きになるのにな…\n逆の場合は…　", 102, 1, 0, 0, 1, 101802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (683, "あん！　見ちゃダメよ\n明日のテストの問題を\n作ってるとこなの！", 1, 2, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (684, "勉強勉強で\n疲れたよね？\n膝枕してあげる！", 2, 2, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (685, "宿題はもうやった？\n苦手なところは\n先生が見てあげる♪", 3, 2, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (686, "んん？　なんだか\n元気がないみたい\n先生がぎゅぅ～って\nしてあげる…　", 4, 2, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (687, "君のお勉強も\nだいぶ進んできたね～\n補習卒業も近いかな？\n少し寂しいけど…", 101, 2, 0, 0, 1, 101802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (688, "テストがんばったね～\nご褒美に先生が\n特別な授業\nしてあげるね？", 102, 2, 0, 0, 1, 101802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (689, "朝の特別授業\nしてあげましょうか？", 1, 2, 0, 1, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (690, "午後の授業って\n眠いでしょう？\n気持ちは分かるけど\nがんばってね♪", 2, 2, 0, 2, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (691, "明日の予習はやった？\n先生も手伝うから\n寝る前にやりましょ♪", 3, 2, 0, 3, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (692, "もしかして…\n少し露出多いかしら？", 1, 3, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (693, "私の膝枕と、どっちが\nフカフカかしら？", 2, 3, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (694, "可愛いわね～\n教室に置いたら\n生徒が喜ぶかしら？　", 3, 3, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (695, "は～落ち着くなぁ～\n教師には\nこういうゆとりも\n必要よね♪　", 4, 3, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (696, "まだ寒いわぁ\n誰か隣に\n来てくれたら…　", 5, 3, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (697, "運動部の顧問も\nできるかしら？　", 6, 3, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (698, "あん！\nお胸にこぼしちゃった", 7, 3, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (699, "あぁーん♪\nこういう物語みたいな\n恋愛あこがれる～　", 8, 3, 0, 0, 1, 101802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (701, "おにいちゃんは、\nにんじん食べられる？", 1, 1, 0, 0, 1, 102001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (702, "えへへ、\nお絵かきしよ～♪", 2, 1, 0, 0, 1, 102001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (703, "あのね、ミミと\nあそんでほしいな～", 3, 1, 0, 0, 1, 102001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (704, "さっきね、きれいな\nお花見つけたよ。\nおにいちゃんにも\n見せてあげたいな～", 4, 1, 0, 0, 1, 102001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (705, "うさぎさん、\nぴょんぴょん\nぴょーん♪", 5, 1, 0, 0, 1, 102001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (706, "おにいちゃんの絵、\nかいてあげるね♪", 101, 1, 0, 0, 1, 102001, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (707, "おっきくなったら\nおにいちゃんの\nお嫁さんになるんだ♪", 102, 1, 0, 0, 1, 102001, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (708, "ふわぁ！\nおにいちゃんの手、\nおっきいね～", 1, 2, 0, 0, 1, 102001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (709, "やった～！\nおにいちゃんが\nほめてくれた～", 2, 2, 0, 0, 1, 102001, 1);
