INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (798, "残さず\n食べますね…！", 7, 3, 0, 0, 1, 102102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (799, "戯曲を読んで\n自分が演じるところを\n想像するの…", 8, 3, 0, 0, 1, 102102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (801, "ねえ、人見知りを\n治すための練習に\n付き合ってくれない？", 1, 1, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (802, "アカリみたいに\nかわいくなるには、\nどうすればいいのかな", 2, 1, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (803, "レアカードをゲット！\nねえねえ、\nすごいでしょ！？", 3, 1, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (804, "ア、アイツと同じ\n部屋にいるのよね…\nって、だから何よ！？", 4, 1, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (805, "楽しいゲームって\nやめどきが\n見つからないわ", 5, 1, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (806, "もっと女の子らしく\nなったらアイツも\n嬉しいかな…って、\n何考えてるの！？", 101, 1, 0, 0, 1, 102201, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (807, "うぅ…最近、\nアイツを見るとなんか\nドキドキするのよね", 102, 1, 0, 0, 1, 102201, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (808, "ゲームに負けた罰\nだからって、\nくすぐるのは…\nあはは…ダメだって！", 1, 2, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (809, "アンタと話すのは割と\n緊張しないのよね\n…なんでかな", 2, 2, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (810, "待ちきれない…\n新作ゲームの発売日が\n待ちきれない…", 3, 2, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (811, "アンタは人見知り\nしないタチよね？\nいいなあ～…", 4, 2, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (812, "ア、アンタってさ\n好きな人とかい…\nなな、何でもない！", 101, 2, 0, 0, 1, 102201, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (813, "アンタと…そ、その\nこうして話してるのも\nわわ、悪くないわね！", 102, 2, 0, 0, 1, 102201, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (814, "おおおおはよう！\n…よし！　ちゃんと\nあいさつできたわ！", 1, 2, 0, 1, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (815, "一緒にごはんとか…\nううん、やっぱいい！\nなんでもないからっ！", 2, 2, 0, 2, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (816, "夜はこれからよ！\n朝まで\nゲームするからね！", 3, 2, 0, 3, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (817, "アカリみたいに\n可愛くなるのは\n難しいかな", 1, 3, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (818, "寝っ転がりながら\nゲームができれば\n気分が良さそう", 2, 3, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (819, "可愛い…けど、\n私には似合わないかな", 3, 3, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (820, "はあ、リラックスして\nゲームができるわ", 4, 3, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (821, "ん…暖かくて、\n寝落ちしちゃいそう", 5, 3, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (822, "ゲーム感覚でやると、\n体動かすのも\n楽しいわね", 6, 3, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (823, "ゲームは頭使うから\nそのぶん\n栄養がいるのよ", 7, 3, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (824, "ふむふむ、なるほど\n友だちを作るには\n笑顔が大事っと…", 8, 3, 0, 0, 1, 102201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (826, "さあ、今日は\n何のゲームで\n遊ぼうかな？", 1, 1, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (827, "一緒にゲームができる\n人がいるっていうのも\n新鮮だな…", 2, 1, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (828, "レアカードをゲット！\nすごいでしょ！？", 3, 1, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (829, "アカリってどうやって\n友達作ってるんだろ？\nコツがあるのかな…", 4, 1, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (830, "楽しいゲームって\nやめどきが\n見つからないわ", 5, 1, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (831, "うぅ…最近\nアイツを見るとなんか\nドキドキするのよね", 101, 1, 0, 0, 1, 102202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (832, "ね、ねえ\nもう少しその…\n一緒にゲームしない？", 102, 1, 0, 0, 1, 102202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (833, "ねえ、人見知りを\n治すための練習に\n付き合ってくれない？", 1, 2, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (834, "欲しいゲームが\n見つからなくて…\n探すの手伝って！", 2, 2, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (835, "ねえ、見て！\n新しいゲームを\n買って来たの！", 3, 2, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (836, "ゲームに負けた罰\nだからって、くすぐる\nのは…あ、あはは！\nだ、ダメだって！", 4, 2, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (837, "ア、アンタってさ\n好きな人とかい…\nなな、何でもない！", 101, 2, 0, 0, 1, 102202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (838, "あ、あのさ…\nもう少し、そこに\nいてくれてもいいわよ", 102, 2, 0, 0, 1, 102202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (839, "おおおおはよう！\n…よし！　ちゃんと\nあいさつできたわ！", 1, 2, 0, 1, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (840, "一緒にごはんとか…\nううん、やっぱいい！\nなんでもないからっ！", 2, 2, 0, 2, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (841, "夜はこれからよ！\n朝まで\nゲームするからね！", 3, 2, 0, 3, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (842, "もっと女の子らしく\nなったらアイツも\n嬉しいかな…って、\n何考えてるの！？", 1, 3, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (843, "ふああ…\n徹夜明けには\n辛い誘惑だな…", 2, 3, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (844, "可愛い…けど、\n私には似合わないかな", 3, 3, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (845, "こういうのに詳しいと\n女の子っぽく\n見えたりするのかな", 4, 3, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (846, "寒い日は\nここでゲームするのが\n最高のぜいたくよね", 5, 3, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (847, "最近ゲームばかりだし\nたまにはいいかな？", 6, 3, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (848, "ゲームは頭使うから\nそのぶん\n栄養がいるのよ", 7, 3, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (849, "ふむふむ、なるほど\n友だちを作るには\n笑顔が大事っと…", 8, 3, 0, 0, 1, 102202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (851, "じゃんけんぽん！\nあっち向いてほい！\nあ～ん、負けたぁ\n　『勝ったぜ！』", 1, 1, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (852, "ぷうきちがいれば、\nなんでも出来ちゃうよ", 2, 1, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (853, "発声練習しよっと\nぷうきち\nフルスイ～ング！", 3, 1, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (854, "ここで、ぷうきち\nフルスイングは、\nまずいかな～？", 4, 1, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (855, "この部屋、ぷうきちを\n置く場所はないのかな", 5, 1, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (856, "お兄ちゃんって…\nちょっとぷうきちに\n似てるかも♪", 101, 1, 0, 0, 1, 102301, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (857, "お兄ちゃんにも、\nぷうきちのこと\n好きになって\nもらいたいな～", 102, 1, 0, 0, 1, 102301, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (858, "おやつは、\n私とぷうきちの\n二人分用意してね♪", 1, 2, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (859, "ぷうきちが、お腹\nペコペコだって～\n何かちょうだい！", 2, 2, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (860, "『アヤネに手出したら\n…坊ちゃんでも、\n分かってんな？』", 3, 2, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (861, "ぷうきちとの\n連携を磨いてるの！\nもっと仲良くなるよ！", 4, 2, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (862, "特別だからね？\nもっと触っていいよ\n…ぷうきちのこと", 101, 2, 0, 0, 1, 102301, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (863, "お兄ちゃんのこと、\n「ぷう兄」って\n呼ぼうかな？", 102, 2, 0, 0, 1, 102301, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (864, "お兄ちゃんって\n朝早いんだね～\n私はまだ眠いよ～", 1, 2, 0, 1, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (865, "ふぁ～…ぷうきちと\nお昼寝してくるね…", 2, 2, 0, 2, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (866, "ぷうきちと\nおしゃべりしてたら\nもうこんな時間…", 3, 2, 0, 3, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (868, "『座り心地がいいな』\nぷうきちは座れない\nでしょ？", 2, 3, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (869, "かわいい～！\nぷうきちのお友達に\nしちゃおうかな？", 3, 3, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (870, "いいニオイ～♪\nぷうきちも\n気に入ったみたい！", 4, 3, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (871, "ぽわぽわする～\nぷうきちも\n気持ちいい？", 5, 3, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (873, "おいしい～\nぷうきちも\n食べてみる？", 7, 3, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (874, "ぷうきち！\nこの本、読んで～！", 8, 3, 0, 0, 1, 102301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (901, "どうして失敗ばっかり\nこうなったら\n腹を切るしか～！", 1, 1, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (902, "あれ？　あれ？\nお部屋の中で迷子に\nなっちゃいました～", 2, 1, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (903, "どうしたら転ばなく\nなるんでしょうか？", 3, 1, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (904, "わわわわ～～っ\nふう…\nきゃ、きゃあっ！", 4, 1, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (905, "私のドジで、\nこのお部屋を\n壊しちゃったら\nどうしましょう～～", 5, 1, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (906, "おいしい料理で\nお出迎えしなくちゃ！", 101, 1, 0, 0, 1, 102501, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (907, "一生懸命\nご奉仕しますよ～♪", 102, 1, 0, 0, 1, 102501, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (908, "耳かきしましょうか？\nえ？　こわい？", 1, 2, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (909, "お疲れでしたら、\nお昼寝しませんか？\n膝枕もしますよ？", 2, 2, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (910, "おかえりなさいませ\nご主人さま♪", 3, 2, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (911, "すみません\nすみません\nすみません～～", 4, 2, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (912, "メイドの私が、\nこんな気持ちを持って\nいいんでしょうか…", 101, 2, 0, 0, 1, 102501, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (913, "私のこと、\n専属メイドと思って\n頼ってくださいね", 102, 2, 0, 0, 1, 102501, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (914, "おはようございます♪\n今日も一日がんば…\nきゃ、きゃあ！", 1, 2, 0, 1, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (915, "お昼ごはん…\n失敗しちゃいましたぁ\nお、おやつでリベンジします！", 2, 2, 0, 2, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (916, "明日の目標は\nドジをしないです！\nき、昨日の目標も\nドジをしないでした", 3, 2, 0, 3, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (917, "あ、メイド服が\nほつれてる\n後でお裁縫しなくちゃ", 1, 3, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (918, "休憩が終わったら\nお洗濯にお料理に\nお掃除もしないと！", 2, 3, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (919, "かわいい♪\nあとでお洗濯\nしてあげますね", 3, 3, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (920, "いい香り…\nお嬢様のお部屋にも\n置いてあげたいです", 4, 3, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (921, "ここでお洗濯ものを\n乾かしましょうか", 5, 3, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (922, "あわわわっ…\nこ、転びそうです～！", 6, 3, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (923, "これくらい\nおいしいものを\n作ってみたいです～", 7, 3, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (924, "物語のメイドさんって\n御主人さまを好きに\nなるんですよね…", 8, 3, 0, 0, 1, 102501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (926, "失敗したら、この\nお部屋追い出され\nちゃうかも～？", 1, 1, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (927, "あれ？　あれ？\nお部屋の中で迷子に\nなっちゃいました～", 2, 1, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (928, "どうやったら、立派な\nメイドになれるのかな", 3, 1, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (929, "塩にはＳマーク\n砂糖にはＳマーク\n…あ、あれ！？", 4, 1, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (930, "ご用があれば\nなんでも言って\nくださいね", 5, 1, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (931, "迷惑をかけすぎて…\n嫌われちゃったら\nどうしましょう", 101, 1, 0, 0, 1, 102502, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (932, "メイドの私が\nこんな気持ちを持って\nいいんでしょうか…　", 102, 1, 0, 0, 1, 102502, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (933, "おでかけですか？\nいってらっしゃいませ\nご主人さま♪", 1, 2, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (934, "どうして失敗ばっかり\nこうなったら\n腹を切るしか～！", 2, 2, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (935, "私、またなにか\nやっちゃいましたか？", 3, 2, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (936, "おいしいお茶っ葉が\n手に入りました～♪\n一緒に飲みませんか？", 4, 2, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (937, "転んだふりであの人に\n…って！\nなんでもないですよ！", 101, 2, 0, 0, 1, 102502, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (938, "私、できることなら\nなんでもやりますよ\nあなたのためですから", 102, 2, 0, 0, 1, 102502, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (939, "おはようございます♪\n今日も一日がんば…\nう、うわあ！", 1, 2, 0, 1, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (940, "お昼ごはん…\n失敗しちゃいましたぁ\nお、おやつでリベンジします！", 2, 2, 0, 2, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (941, "明日の目標は\nドジをしないです！\nき、昨日の目標も\nドジをしないでした", 3, 2, 0, 3, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (942, "あ、メイド服が\nほつれてる\n後でお裁縫しなくちゃ", 1, 3, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (943, "いい座り心地です～\nこれならお嬢さまも\nゆったりできますね♪", 2, 3, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (944, "かわいい♪\nあとでお洗濯\nしてあげますね", 3, 3, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (945, "いい香り…\nお嬢様のお部屋にも\n置いてあげたいです", 4, 3, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (946, "暖かいですけど\n…私が火に近づいて\n大丈夫でしょうか！？", 5, 3, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (947, "運動しようとすると\nいつも怪我するん\nですよね…", 6, 3, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (948, "こんなに美味しいもの\nメイドの私には\nもったいないです～！", 7, 3, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (949, "物語のメイドさんって\n御主人さまを好きに\nなるんですよね…", 8, 3, 0, 0, 1, 102502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (951, "あの方と私だけの\n部屋にしたいですわ", 1, 1, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (952, "あの方は私のもの…\n眼も耳も鼻も口も髪も\n首も胸も腰も手も脚も\nぬくもりも心も…！", 2, 1, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (953, "運命とは決して\n抗えないもの…\nクスクス…クスクス", 3, 1, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (954, "部屋からあの方の\n香りが…\nああ、至福ですわ", 4, 1, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (955, "毒にも薬にもならない\n存在なんて嫌ですわ\nどうせならとびきりの\n毒でありたい…", 5, 1, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (956, "クスクス…\nあの方とデートする\nイメトレ中ですわ\nクスクスクスクス…", 101, 1, 0, 0, 1, 102701, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (957, "記憶を戻す研究より\n記憶をねつ造する研究\nのほうが良いかしら？\n伴侶という設定で…", 102, 1, 0, 0, 1, 102701, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (958, "運命を信じますか？\nもちろん絶対当然\n信じますわよね？", 1, 2, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (959, "この薬は起床時就寝前\n食前食後食間に、毎日\n服用してください。\n惚れ薬ですわ", 2, 2, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (960, "お願いがあるのです。\n新しい研究の実験台に\n…", 3, 2, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (961, "こっそり栽培している\n毒きのこが毒々しく\n育ちましたわ…", 4, 2, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (962, "あなた様の前では\n普通の女の子…\n少し毒薬づくりが\n得意なだけの…", 101, 2, 0, 0, 1, 102701, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (963, "私の身も心も、全てが\nあなた様のもの。\nあなた様の全ても…", 102, 2, 0, 0, 1, 102701, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (964, "おはようございます\n一晩中、あなた様の\n寝顔を見ていましたわ", 1, 2, 0, 1, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (965, "お昼を用意しましたの\n何も入れていませんわ\nクスクス…", 2, 2, 0, 2, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (966, "あなた様が眠るまで\nお傍で見守りますわ。\n…あの、どうして\n眠らないのですか？", 3, 2, 0, 3, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (967, "いっそ鏡の中に\n閉じ込めてしまえたら\n私だけのものに…", 1, 3, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (968, "はっ！\nリラックスしたら\n閃きましたわ！", 2, 3, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (969, "あら、キメラの素体に\nぴったりですわ", 3, 3, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (970, "このお部屋は\n良い香りがしますわ。\nはっ、あなた様の匂い\nなのでは…！？", 4, 3, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (971, "あたたかい…\n加熱調合にも\n使えそうですわね", 5, 3, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (972, "この運動エネルギー\n何かにうまく\n利用できないかしら？", 6, 3, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (973, "美味しい。あの方にも\n差し上げましょう…\n薬を入れて…", 7, 3, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (974, "あの方を虜にする\n方法がどこかに\n載ってるはずですわ", 8, 3, 0, 0, 1, 102701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (976, "あの方と私だけの\n部屋にしたいですわ", 1, 1, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (977, "こっそり栽培している\n毒きのこが毒々しく\n育ちましたわ…", 2, 1, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (978, "新しい薬\nどうやってあの方に\n飲ませようかしら", 3, 1, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (979, "部屋からあの方の\n香りが…\nああ、至福ですわ", 4, 1, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (980, "記憶を戻す研究より\n記憶をねつ造する研究\nのほうが良いかしら？\n伴侶という設定で…", 5, 1, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (981, "クスクス…\nあの方とデートする\nイメトレ中ですわ\nクスクスクスクス…", 101, 1, 0, 0, 1, 102702, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (982, "魔法も科学も錬金術も\n全て駆使して\nあの方のために…", 102, 1, 0, 0, 1, 102702, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (983, "この部屋には雌犬…\n失礼、女の方がとても\n沢山いますのね", 1, 2, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (984, "あなた様には私の伴侶\nとして高い教養を…\nあ、逃げられてしまい\nましたわ…！", 2, 2, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (985, "お願いがあるのです\n新しい研究の\n実験台に…", 3, 2, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (986, "あなた様が寝ている時\n私は…クスクス\nこれ以上は言えません", 4, 2, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (987, "想像の中のあなた様は\nすっかり私の虜なのに\n現実は…\nもどかしいですわね", 101, 2, 0, 0, 1, 102702, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (988, "あなた様の前では\n普通の女の子…\n少し毒薬づくりが\n得意なだけの…", 102, 2, 0, 0, 1, 102702, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (989, "おはようございます\n一晩中、あなた様の\n寝顔を見ていましたわ", 1, 2, 0, 1, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (990, "さあ、お食事ですよ\n味は保証しますわ\n特製ソースで少しだけ\n体が痺れますけど…", 2, 2, 0, 2, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (991, "あなた様が眠るまで\nお傍で見守りますわ\n…あの、どうして\n眠らないのですか？", 3, 2, 0, 3, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (992, "私ももう少し\n外見に気を配る\nべきでしょうか…", 1, 3, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (993, "はっ！\nリラックスしたら\n閃きましたわ！", 2, 3, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (994, "この私を差し置いて\nあなた様に媚びるなど\n言語道断…っ！", 3, 3, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (995, "このお部屋は\n良い香りがしますわ\nはっ、あなた様の匂い\nなのでは…！？", 4, 3, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (996, "素敵なぬくもり…\nまるであの方に\n抱きしめられたような", 5, 3, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (997, "この運動エネルギー\n何かにうまく\n利用できないかしら？", 6, 3, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (998, "美味しい。あの方にも\n差し上げましょう…\n薬を入れて…", 7, 3, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (999, "あの方を虜にする\n方法がどこかに\n載ってるはずですわ", 8, 3, 0, 0, 1, 102702, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1001, "子供たちの遊びって\nあたしが子供の頃と\nあまり変わらないのね", 1, 1, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1002, "使えるものは\n再利用しないと\n…あ、これとか\nまだ使えるわね", 2, 1, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1003, "贅沢は敵！　とはいえ\n気持ちに余裕のない\n暮らしはダメよね", 3, 1, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1004, "お腹空いたわね、\n残り物で\n何か作ろうかしら", 4, 1, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1005, "商売はノンゼロサムが\n理想だなぁ。誰も損を\nしないってことだもの", 5, 1, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1006, "あんたが手伝って\nくれるから、仕事も\n前より楽しいのよね♪", 101, 1, 0, 0, 1, 102801, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1007, "焼きそばパンが\n食べたいな～\nあいつと…", 102, 1, 0, 0, 1, 102801, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1008, "ねぇあんた、どこか\n安いお店知らない？", 1, 2, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1009, "あたし、エレガントに\n振る舞えてる？\n…そう？　嬉しい♪", 2, 2, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1010, "いっぱい働いて遊んで\nよく休んでまた働く。\nそれが健全な生活よね", 3, 2, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1011, "一緒に部屋の\n整頓でもする？\nハマると楽しいわよ♪", 4, 2, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1012, "あんたがいると\n子供たちも喜ぶわ♪\nもちろんあたしもね！", 101, 2, 0, 0, 1, 102801, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1013, "ね、あんた今、幸せ？\n何びっくりしてるのよ\n大事なことじゃないの", 102, 2, 0, 0, 1, 102801, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1014, "面倒な用事は午前中に\n片づけてしまうのが、\n時間の使い方のコツよ", 1, 2, 0, 1, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1015, "午後のティータイム\nとかどう？\n良いカフェがあるの♪", 2, 2, 0, 2, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1016, "さ、エレガントな夜を\n楽しみましょ。\nモダンな音楽でも\nかけましょうか？", 3, 2, 0, 3, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1017, "レディたるもの\n身嗜みはしっかりとね\n見本にならないと♪", 1, 3, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1018, "これで仕事は一段落ね\nちょっと休憩…", 2, 3, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1019, "うふふ、\nかわいいものを\n見るのは幸せね～", 3, 3, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1020, "部屋中がいい香り…\nなんだかすごい贅沢\nしてる気分♪", 4, 3, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1021, "風邪を引かないように\n身体を温めなくちゃ", 5, 3, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1022, "さっ！　家の中でも\n効率的に\nトレーニングよ！", 6, 3, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1023, "もぐもぐ…はっ、\n口の周り、\n汚れてないわよね？", 7, 3, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1024, "知識から過去を学んで\n未来に活かすわよ", 8, 3, 0, 0, 1, 102801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1026, "安売りのお店の情報\n整理しないと…", 1, 1, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1027, "どんなに苦労してても\nそう見せないのが真の\nエレガントなレディよ", 2, 1, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1028, "安く済んであいつが\n喜ぶ料理とか…\nないかしら", 3, 1, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1029, "子供たちの遊びって\nあたしが子供の頃と\nあまり変わらないのね", 4, 1, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1030, "商売はノンゼロサムが\n理想だなぁ。誰も損を\nしないってことだもの", 5, 1, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1031, "焼きそばパンが\n食べたいな～\nあいつと…", 101, 1, 0, 0, 1, 102802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1032, "あいつと一緒に…\n色々なところに\nいきたいな", 102, 1, 0, 0, 1, 102802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1033, "今度買い物に\n付き合いなさい\nセールがあるのよ", 1, 2, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1034, "あんたがいると子供\nたちも喜ぶわ♪\nもちろんあたしもね♪", 2, 2, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1035, "いっぱい働いて遊んで\nよく休んでまた働く\nそれが健全な生活よね", 3, 2, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1036, "あんたとこうして\nのんびりするのも\nいいものね", 4, 2, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1037, "ねえ、今度遊びに\n行きたいな\nもちろん一緒に、よ", 101, 2, 0, 0, 1, 102802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1038, "あんたが手伝って\nくれるから、仕事も\n前より楽しいのよね♪", 102, 2, 0, 0, 1, 102802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1039, "面倒な用事は午前中に\n片づけてしまうのが\n時間の使い方のコツよ", 1, 2, 0, 1, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1040, "ランチにして午後の\n仕事に備えましょ！\nやることは一杯よ♪", 2, 2, 0, 2, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1041, "ふわあ～\nもうこんな時間\n子供たちは\nもう寝たかしら", 3, 2, 0, 3, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1042, "忙しい時こそ\n身だしなみは隙なく\nぴしっとね！", 1, 3, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1043, "これで仕事は一段落ね\nちょっと休憩…", 2, 3, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1044, "ふふふ\nずっと眺めてたく\nなっちゃうわね", 3, 3, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1045, "部屋中がいい香り…\nなんだかすごい贅沢\nしてる気分♪", 4, 3, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1046, "風邪を引かないように\n身体を温めなくちゃ", 5, 3, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1047, "さっ！　家の中でも\n効率的に\nトレーニングよ！", 6, 3, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1048, "しっかり食べて\n栄養補給、栄養補給！", 7, 3, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1049, "知識から過去を学んで\n未来に活かすわよ", 8, 3, 0, 0, 1, 102802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1051, "可愛い子が\nいっぱいいるなぁ…\n誰か私とユニット\n組んでくれないかな？", 1, 1, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1052, "今度のライブ会場、\nいつもより大きいから\n楽しみなんだ～！", 2, 1, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1053, "新曲の衣装、もうすぐ\n出来あがるんだって！\n楽しみだな～", 3, 1, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1054, "彼とデュエット\nしてみたいな～♪", 4, 1, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1055, "キラキラ無病息災、\nドキドキ一日一善…\n作詞って難しい～", 5, 1, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1056, "ファンはもちろん\n大事だけど…\n彼のことは、もっと\n大切にしたいな…", 101, 1, 0, 0, 1, 102901, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1057, "写真集見なくても、\n本物がここに\nいるのにな～", 102, 1, 0, 0, 1, 102901, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1058, "握手会の練習、\n付き合ってくれない？", 1, 2, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1059, "写真集のポーズ\n練習中～！\nど、どうかな？", 2, 2, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1060, "何て書いてあるか\n読めないって？\nもー！\nこれは私のサイン！", 3, 2, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1061, "ね、次のライブ\n観に来てくれる？\nいい席とっとくから！", 4, 2, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1062, "ねぇ、台本読むの\nつきあってくれる？\n恋人役に\nなってほしいんだ", 101, 2, 0, 0, 1, 102901, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1063, "新曲、聞いてくれた？\nキミとのことを\nテーマにしたんだよ。\nどこかは秘密だけど♪", 102, 2, 0, 0, 1, 102901, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1064, "朝の発声練習に\n行くけど、キミも\n一緒に来ない？", 1, 2, 0, 1, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1065, "この時間は\nお腹すくけど…\n水着撮影があるから\nお昼抜いてるんだ", 2, 2, 0, 2, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1066, "夜の帳が二人を包み\n…こういう方向性の\n歌詞も悪くないなぁ。", 3, 2, 0, 3, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1067, "身だしなみオッケー！\nアイドルはいつでも\n完璧でいなくちゃ！", 1, 3, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1068, "ふぅ…\nこんな姿、ファンには\n見せられないな～", 2, 3, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1069, "かわいい～♪\nこれは強力な\nライバル登場かな！", 3, 3, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1070, "ステキな香り～♪\n歌詞のイメージが\n浮かんできそう！", 4, 3, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1071, "体も暖まったし！\nダンスレッスンに\n行こうかな♪", 5, 3, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1072, "ベストタイム更新！\nライブに向けて\n体力つけないと…", 6, 3, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1073, "太っちゃったら\nどうしよう…？\nでも手が止まらない～", 7, 3, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1074, "ステキなお話…\n新曲の作詞の\n参考になりそう♪", 8, 3, 0, 0, 1, 102901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1076, "このお部屋すてき！\nファンに追われた時の\n隠れ家にピッタリね！", 1, 1, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1077, "そろそろイメチェン\nしてみようかな…\nそれともこの路線で\nもう少し…？", 2, 1, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1078, "みんながくれた\nファンレター…\n私の大事な宝物…", 3, 1, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1079, "彼とデュエット\nしてみたいな～♪", 4, 1, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1080, "疾風怒濤、威風堂々\n獅子奮迅、唯我独尊…\nラブソングの作詞って\n難しいな～", 5, 1, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1081, "ファンはもちろん\n大事だけど…\n彼のことは、もっと\n大切にしたいな…", 101, 1, 0, 0, 1, 102902, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1082, "トップアイドルの\nさらに先…\n彼とならその景色も\n見られるかな", 102, 1, 0, 0, 1, 102902, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1083, "新曲の衣装、もうすぐ\n出来あがるんだって！\n楽しみだな～", 1, 2, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1084, "アイドルノゾミだけ\nじゃなくて、私の事も\nちゃんと見てね？", 2, 2, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1085, "キミに響かないなら\nファンにも響くわけ\nないよ！　練習練習！", 3, 2, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1086, "衣装のスカートは\n鉄壁なんだよ！\n残念でした～", 4, 2, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1087, "新曲、聞いてくれた？\nキミとのことを\nテーマにしたんだよ\nどこかは秘密だけど♪", 101, 2, 0, 0, 1, 102902, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1088, "ねぇ、私がトップ\nアイドルになっても\nちゃんと隣にいてね\n遠くに行かないでね？", 102, 2, 0, 0, 1, 102902, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1089, "朝の発声練習に\n行くけど、キミも\n一緒に来ない？", 1, 2, 0, 1, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1090, "お昼ごはん行かない？\n誰にも知られてない\nお店があるんだけど！", 2, 2, 0, 2, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1091, "夜の帳が二人を包み\n…こういう方向性の\n歌詞も悪くないなぁ", 3, 2, 0, 3, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1092, "身だしなみオッケー！\nアイドルはいつでも\n完璧でいなくちゃ！", 1, 3, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1093, "ふぅ…\nこんな姿、ファンには\n見せられないな～", 2, 3, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1094, "かわいい～♪\nこれは強力な\nライバル登場かな！", 3, 3, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1095, "みんなのイメージする\nアイドルの香りは\nこんな感じかな～", 4, 3, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1096, "体も暖まったし！\nダンスレッスンに\n行こうかな♪", 5, 3, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1097, "ベストタイム更新！\nライブに向けて\n体力つけないと…", 6, 3, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1098, "太っちゃったら\nどうしよう…？\nでも手が止まらない～", 7, 3, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1099, "この恋愛小説ステキ！\n私もアイドルじゃ\nなかったら…", 8, 3, 0, 0, 1, 102902, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1101, "手裏剣の数が\n合わないデス！\nどこかに落とした\nデスか…？", 1, 1, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1102, "クセモノ、隠れても\nむだデス！\n…気のせいデシタ", 2, 1, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1103, "金は天下の\nマワリモノ！\nところで、\nどういう意味デス？", 3, 1, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1104, "むむ、アクダイカンの\n気配がするデース", 4, 1, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1105, "クニトリ合戦、\n楽しみデース！", 5, 1, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1106, "ショーグンと\n出会えて、\nワタシは果報者デス！", 101, 1, 0, 0, 1, 103001, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1107, "最近、ショーグンの\nそばにいると\nドキドキするデス…", 102, 1, 0, 0, 1, 103001, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1108, "なんでも\n命令するデス！\nショーグンの命は\n絶対デス！", 1, 2, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1109, "あっ、ショーグン、\n出陣はいつで\nゴザルデス！？", 2, 2, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1110, "さ、さすが\nショーグンデス…\nいつの間に背後を！？", 3, 2, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1111, "出陣の合図に\n備えるデス！\nほら貝は\nどこデスか！？", 4, 2, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1112, "見つめられると\nドキドキするデス…\n新しい忍法デスか？", 101, 2, 0, 0, 1, 103001, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1113, "ショーグン！\nえへへ…これからも\nおそばに置いて\nクダサイね？", 102, 2, 0, 0, 1, 103001, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1114, "おはようデス！\n今日も一日\n忍法日和デス！", 1, 2, 0, 1, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1115, "そろそろお腹\n空いてきたデス。\n昼ごはんにするデス！", 2, 2, 0, 2, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1116, "明日もきっと\nいい日デスよ、\nショーグン！", 3, 2, 0, 3, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1117, "ちょんまげに\nしてみるのも\n面白いかもデス！", 1, 3, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1118, "心地よくて\n眠くなってきマス…\nもしやテキコクの\n罠デスか！？", 2, 3, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1119, "これを変わり身の\n術に…かわいそう\nだから止めるデス", 3, 3, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1120, "ワビサビというもの\nデスね！\n素晴らしいデス！", 4, 3, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1121, "身体を暖めて\nイクサに向かうデス！", 5, 3, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1122, "アクロバットな忍法を\n使うには、体を\n鍛えないと危険デス！", 6, 3, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1123, "うーん、\n美味しいデス…\n幸せデス～", 7, 3, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1124, "これは…\nＢＵＳＨＩＤＯ…\nデスか？", 8, 3, 0, 0, 1, 103001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1126, "ふんふんふ～ん\n武器の手入れは\n念入りにしマスよ～", 1, 1, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1127, "クセモノ、隠れても\nむだデス！\n…気のせいデシタ", 2, 1, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1128, "金は天下の\nマワリモノ！\nところで\nどういう意味デス？", 3, 1, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1129, "むむ、アクダイカンの\n気配がするデース", 4, 1, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1130, "クニトリ合戦\n楽しみデース！", 5, 1, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1131, "最近、ショーグンの\nそばにいると\nドキドキするデス…", 101, 1, 0, 0, 1, 103002, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1132, "ショーグンの身は\n何があってもワタシが\n守るデス！", 102, 1, 0, 0, 1, 103002, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1133, "あっ、ショーグン\n出陣はいつで\nゴザルデス！？", 1, 2, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1134, "イクサの前に\nホネ休めも大事デスよ\nゆっくりするデース！", 2, 2, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1135, "さ、さすがショーグン\nデス…いつの間に\n背後を！？", 3, 2, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1136, "一緒に忍法考える\nデス！\nショーグン用の\n忍法も必要デスね！", 4, 2, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1137, "見つめられると\nドキドキするデス…\n新しい忍法デスか？", 101, 2, 0, 0, 1, 103002, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1138, "ショーグン！\nえへへ…これからも\nおそばに置いて\nクダサイね？", 102, 2, 0, 0, 1, 103002, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1139, "いい朝デス！\nトーゴク風の朝ゴハン\n作るデス！", 1, 2, 0, 1, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1140, "もうお昼デス\nお昼寝するデスか？", 2, 2, 0, 2, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1141, "そろそろおネム\nデース…\n一緒に寝るデス？", 3, 2, 0, 3, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1142, "服の乱れは心の乱れ\nデス！　きっちり\nしないといけないデス", 1, 3, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1143, "心地よくて眠く\nなってきマス…\nもしやテキコクの\n罠デスか！？", 2, 3, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1144, "これを変わり身の\n術に…かわいそう\nだから止めるデス", 3, 3, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1145, "ワビサビというもの\nデスね！\n素晴らしいデス！", 4, 3, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1146, "身体を暖めてイクサに\n向かうデス！", 5, 3, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1147, "ショーグンのお役に\n立つため、修行\nあるのみデス！", 6, 3, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1148, "美味しいデス…\n酢昆布を和えて\nみたいデス", 7, 3, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1149, "物事を知って\n来たるべきイクサに\n活かすデス", 8, 3, 0, 0, 1, 103002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1151, "お父さん、そろそろ\n子離れを…しない？\nそうですか…", 1, 1, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1152, "父は、いつも男性に\nきびしいですね", 2, 1, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1153, "占ってほしい人は、\nいつでも言って\nください", 3, 1, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1154, "あなたの手相は…\nて、手を握るのって\n緊張しますね", 4, 1, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1155, "この部屋、風水的にも\n運気が上がりそうです", 5, 1, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1156, "あの人とのこと占って\nみようかな…\n好き…嫌い…\n好き♪…き、嫌い", 101, 1, 0, 0, 1, 103101, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1157, "私との相性ですか？\nそれなら占う必要は\nありませんよ…\nふふっ♪", 102, 1, 0, 0, 1, 103101, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1158, "女難の相が\n出ていますね…\n気をつけてください", 1, 2, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1159, "今日のあなたの運勢は\n大きょ…\n大吉です", 2, 2, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1160, "父と散歩中です。\n毎日決まったコースを\n散歩させないと、\nストレスが溜まるので", 3, 2, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1161, "小僧！\nシノブに触るとは\nいい度胸じゃねぇか！", 4, 2, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1162, "あなたに触られると、\n動悸が早くなります\nもしかして心霊現象？", 101, 2, 0, 0, 1, 103101, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1163, "今日もたくさんの幽霊\nに慕われていますね。\n素敵です", 102, 2, 0, 0, 1, 103101, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1164, "おはようございます\n今日の運勢を\n占いましょうか？", 1, 2, 0, 1, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1165, "今日のラッキー\nアイテムはドクロです\n良ければ父を\nお貸ししましょうか？", 2, 2, 0, 2, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1166, "今日のあなたの運気は\n最高潮でした。\nもうすぐ今日は\n終わりますが", 3, 2, 0, 3, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1167, "お父さん。\nいつも、身だしなみに\n気を使ってるけど、\nあまり変わってないよ", 1, 3, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1168, "一休みしましょう。\n憑かれて疲れました", 2, 3, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1169, "かわいい…\n付喪神が宿らないかな", 3, 3, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1170, "お父さん、\nリラックスし過ぎると\n成仏しちゃうよ？", 4, 3, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1171, "気持ちいいです…\n極楽浄土みたい…", 5, 3, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1172, "はぁはぁ…\nお、お父さん、\n代わりに運動して…", 6, 3, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1173, "お父さんも\n食べたいの？\n死んでるのに？", 7, 3, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1174, "この本…\nもしかして予言書？", 8, 3, 0, 0, 1, 103101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1176, "ここにいる幽霊は\nみんな幸せそうです", 1, 1, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1177, "お父さんが\n女の子ばかりに\n声をかけるので\n困っています", 2, 1, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1178, "成仏はうれしいこと\nです…でも友達が\n減るのは寂しいですね", 3, 1, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1179, "幽霊に好かれる人は\n素敵な方です\nもちろん、あなたも", 4, 1, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1180, "お父さん、そろそろ\n子離れを…しない？\nそうですか…", 5, 1, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1181, "生きている人に\n好かれるには、\nどうすればいい\nのでしょう？", 101, 1, 0, 0, 1, 103102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1182, "お父さん、どうしたら\nあの人のことを\n認めてくれますか？", 102, 1, 0, 0, 1, 103102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1183, "この部屋、風水的にも\n運気が上がりそうです", 1, 2, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1184, "シノブには指一本\n触れさせん！\nガブッ！！", 2, 2, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1185, "あなたの手相は…\nて、手を握るのって\n緊張しますね", 3, 2, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1186, "ラップ音？\nいえ、父のいびきです", 4, 2, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1187, "私との相性ですか？\nそれなら占う必要は\nありませんよ…\nふふっ♪", 101, 2, 0, 0, 1, 103102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1188, "前世って信じますか？\n私とあなたは\nもしかすると…", 102, 2, 0, 0, 1, 103102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1189, "今日のラッキー\nアイテムはドクロです\n良ければ父を\nお貸ししましょうか？", 1, 2, 0, 1, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1190, "明るい時間は\nあまり得意では\nないんです…", 2, 2, 0, 2, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1191, "夜のお散歩に\n行きませんか？\n知り合いの幽霊に\n挨拶して回るんです", 3, 2, 0, 3, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1192, "お父さん\nいつも、身だしなみに\n気を使ってるけど\nあまり変わってないよ", 1, 3, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1193, "うとうと…\nあれ…\n走馬灯が見える…", 2, 3, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1194, "かわいい…\nお父さんみたい…", 3, 3, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1195, "お父さん\nリラックスし過ぎると\n成仏しちゃうよ？", 4, 3, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1196, "快適です…\n幽霊もどんどん\n集まってきますね…", 5, 3, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1197, "はぁはぁ…\nお、お父さん、\n代わりに運動して…", 6, 3, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1198, "お父さんの分も、\n私が食べるね", 7, 3, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1199, "この本の占い\n私の占いと違う…", 8, 3, 0, 0, 1, 103102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1201, "私だって、一人で\n買い物ぐらい\nできますわ…きっと", 1, 1, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1202, "そろそろ新しい\n案件を始めないと\nいけませんわね", 2, 1, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1203, "一日も早く、\n一人前の商人に\nなりたいものです", 3, 1, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1204, "平和を買うのには\nどれほどのお金が\n必要なのかしら？", 4, 1, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1205, "ここももう少し広いと\n落ち着くのですけど。\n改築しませんこと？", 5, 1, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1206, "あの方はお金で雇った\nわけではないのに\n私といてくださる…", 101, 1, 0, 0, 1, 103201, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1207, "たとえ私が間違っても\nきっとあの方が\n正してくれますわ…", 102, 1, 0, 0, 1, 103201, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1208, "私と、庶民向けの\nお店へ一緒に\n参りませんか？", 1, 2, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1209, "資産運用？\nお幾らほど\n増やしたいのです？", 2, 2, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1210, "どんぶり勘定だとよく\n言われるのですが…\n例えが小さすぎます！", 3, 2, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1211, "お金で解決するのは\n悪いことでは\nありませんわよね？", 4, 2, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1212, "その、よろしければ\n私とお散歩など\nいかがです？", 101, 2, 0, 0, 1, 103201, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1213, "もしあなたさまが\n道に迷われるなら、\n私もお供いたします！", 102, 2, 0, 0, 1, 103201, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1214, "早起きは三ルピの徳と\n申しますが…\nもっとお得ですわね", 1, 2, 0, 1, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1215, "昼食は町の屋台で\n立ったまま食べて\nみたいですわ！", 2, 2, 0, 2, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1216, "よろしければ\nお休み前のミルクを\n御一緒にいかが？", 3, 2, 0, 3, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1217, "だらしない身なりでは\n取引相手に信用して\nいただけませんものね", 1, 3, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1218, "この感触と安らぎ…\n素晴らしい\n費用対効果ですわ…", 2, 3, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1219, "何の見返りも求めず\nただひたすら愛でて\nいたいのです！", 3, 3, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1220, "目に見えないものに\nお金をかけるのが\n真の贅沢ですわ！", 4, 3, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1221, "誰ひとり寒い思いを\nしない町にするために\n私にできる事は…", 5, 3, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1222, "健康はお金では\n買えませんが\n運動器具は別ですわ！", 6, 3, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1223, "なかなか\n美味ですわ\nシェフはどちらに？", 7, 3, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1224, "経済の仕組みを\nしっかりと\n学ばなくては…", 8, 3, 0, 0, 1, 103201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1226, "そろそろ新しい\n案件を始めないと\nいけませんわね", 1, 1, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1227, "ええと、これは\nおいくらで買ったん\nでしたっけ？", 2, 1, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1228, "お金を見せたら\n態度が変わる人は\n信用できませんわ", 3, 1, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1229, "地図が読めずとも\n道に迷わない方って\nいらっしゃるのですね", 4, 1, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1230, "この狭さも\n慣れれば\n快適ですわ♪", 5, 1, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1231, "あの方はお金で雇った\nわけではないのに\n私といてくださる…", 101, 1, 0, 0, 1, 103202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1232, "たとえ私が間違っても\nきっとあの方が\n正してくれますわ…", 102, 1, 0, 0, 1, 103202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1233, "一人前の商人に\n相応しい居振る舞いを\nしたいものですわ", 1, 2, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1234, "幼い頃\nお店屋さんごっこを\nなさいましたか？", 2, 2, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1235, "資産運用？\nお幾らほど\n増やしたいのです？", 3, 2, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1236, "今度一緒に…\nパーティにでも\n行きませんこと？", 4, 2, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1237, "その、よろしければ\n私とお散歩など\nいかがです？", 101, 2, 0, 0, 1, 103202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1238, "あなたさまの優しさは\nお金には\n代えられませんわね", 102, 2, 0, 0, 1, 103202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1239, "なぜだか\n眠り足りないような\n感じがしますわ…", 1, 2, 0, 1, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1240, "昼食は町の屋台で\n立ったまま食べて\nみたいですわ！", 2, 2, 0, 2, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1241, "よろしければ\nお休み前のミルクを\n御一緒にいかが？", 3, 2, 0, 3, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1242, "ドレスは汚れていない\nようですが…やだ\n髪がほつれてますわ！", 1, 3, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1243, "こういったものに\n腰を沈めると…\nき、気が緩んで…", 2, 3, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1244, "何の見返りも求めず\nただひたすら愛でて\nいたいのです！", 3, 3, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1245, "香りは質のいいものと\nそうでないものが\nはっきり分かりますわ", 4, 3, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1246, "誰ひとり寒い思いを\nしない町にするために\n私にできる事は…", 5, 3, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1247, "目標は遠くに\n置いた方が励みに\nなりますわ！", 6, 3, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1248, "なかなか\n美味ですわ\nシェフはどちらに？", 7, 3, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1249, "商人って、物語では\n悪役にされやすいの\nですね…", 8, 3, 0, 0, 1, 103202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1251, "家の中のものを使って\n物ボケ、考えるべ！", 1, 1, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1252, "毎日の日課…それは\n炊事、洗濯、大喜利\nだべ！", 2, 1, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1253, "うちに塀ができたら、\nへー、って言いたい！", 3, 1, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1254, "オラが作る料理は\nこの後スタッフで\n美味しくいただくべよ", 4, 1, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1255, "エリザベスも\n連れてきてぇ～", 5, 1, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1256, "あんちゃんも、\nエリザベスと同じ位\nめんこいべ♪", 101, 1, 0, 0, 1, 103301, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1257, "オラとあんちゃん、\n息がぴったりに\nなってきたべ…！", 102, 1, 0, 0, 1, 103301, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1258, "おぉ！　そんな急に\nツッコまれたら、\nびっくらこくべやー！", 1, 2, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1259, "ネタはオラが書くけど\nあんちゃんが\n書きたかったら\n書いてもいいんだぞ？", 2, 2, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1260, "あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！", 3, 2, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1261, "押すなよ、\n絶対押すなよ\n…なんて\n言ってないべさ？", 4, 2, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1262, "うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～", 101, 2, 0, 0, 1, 103301, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1263, "将来的には夫婦漫才\nってのも…あ、ひ、\nひとりごとだべさ～！", 102, 2, 0, 0, 1, 103301, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1264, "おはよう！　一緒に\n牛の乳しぼりいくべ？", 1, 2, 0, 1, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1265, "お昼だ～腹が減っては\n笑いはできぬ～！", 2, 2, 0, 2, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1266, "今日もよく働いたべ！\nさ、今からは\nお笑いの練習だ～！", 3, 2, 0, 3, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1267, "舞台に上がる前に\n身なりは整えねぇと\nだめだべ～！", 1, 3, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1268, "ナイスなイスに\n座りたい、\nなんちゃって！", 2, 3, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1269, "めんこいのは、\nスベっても許される\nからずるいべな～？", 3, 3, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1270, "必要以上に\n癒されちまうべや～", 4, 3, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1271, "ぽかぽかだ…\nウケた会場みてぇだ", 5, 3, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1272, "お笑い芸人は、\n体が資本だべさ～！", 6, 3, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1273, "もぐもぐ…\nボケることも\n忘れちまう美味さだ～", 7, 3, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1274, "ネタ作りのヒントが\n載ってねぇか探すべ", 8, 3, 0, 0, 1, 103301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1276, "さぁ今日も張り切って\n漫才の練習するべさ！", 1, 1, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1277, "この部屋でも、商品\n売っていいんだべか？", 2, 1, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1278, "眼鏡を頭の上に乗せて\n「メガネメガネ～」\nって言う練習した方が\nいいべか？", 3, 1, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1279, "漫才を持ち時間に\n収めるには、何度も\n練習するしかねぇべ", 4, 1, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1280, "エリザベスも\n連れてきてぇ～", 5, 1, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1281, "うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～", 101, 1, 0, 0, 1, 103302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1282, "あんちゃんに\n採れたての食材を\n食わしてやりてぇ～", 102, 1, 0, 0, 1, 103302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1283, "押すなよ\n絶対押すなよ\n…なんて\n言ってないべさ？", 1, 2, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1284, "あんちゃん、百連\nツッコミ特訓だ～！", 2, 2, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1285, "あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！", 3, 2, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1286, "「なんでだべ～！」\nって言いながら\nツッコむといいべ！", 4, 2, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1287, "あはは～あんちゃんの\nツッコミはやっぱり\n気持ちいいなぁ～", 101, 2, 0, 0, 1, 103302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1288, "将来的には夫婦漫才\nってのも…あ、ひ\nひとりごとだべさ～！", 102, 2, 0, 0, 1, 103302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1289, "おはよう！\n今日もいい\nネタ作り日和だ！", 1, 2, 0, 1, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1290, "お昼だな\nご飯を食べたら、\nネタの練習するべ！", 2, 2, 0, 2, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1291, "もうこんな時間だべ\nネタ作りは\n明日にするべ…", 3, 2, 0, 3, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1292, "うーん…衣装、\nずれてねぇべか？", 1, 3, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1293, "ナイスなイスに\n座りたい\nなんちゃって！", 2, 3, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1294, "はう～\nなまらめんこいべや～", 3, 3, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1295, "必要以上に\n癒されちまうべや～", 4, 3, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1296, "笑いをとることを\n忘れるほど\nあったけぇべ～", 5, 3, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1297, "たくさん運動して\n動きでも笑いがとれる\nように頑張るべ～！", 6, 3, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1298, "もぐもぐ…\nボケることも\n忘れちまう美味さだ～", 7, 3, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1299, "幅広く教養を\n身につけて\nいいネタ作るべ！", 8, 3, 0, 0, 1, 103302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1301, "通りにいる\nカップル…爆発\nすればいいのに…", 1, 1, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1302, "う～ん、仕事なんて\nしないで、\n飲んでたいな～", 2, 1, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1303, "今日は一日、\n外に出ない！\nもう決めたわ！", 3, 1, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1304, "お腹空いた…\nけど、外に出るのは\n面倒だなぁ", 4, 1, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1305, "うぅ…頭がガンガン\nする…昨日、\n飲み過ぎたかな…", 5, 1, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1306, "デートとか…\n誘っても嫌がられ\nないかな…？", 101, 1, 0, 0, 1, 103401, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1307, "もしかして運命の\n相手だったり…\nするのかな", 102, 1, 0, 0, 1, 103401, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1308, "やっぱり一杯目が\n一番おいしいわ～！\n…え、見てた！？", 1, 2, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1309, "頼れるお姉さんだって\nところ、もっと見せて\nあげるからね", 2, 2, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1310, "ねえ、一緒に買い物に\n行かない？　その…\nの、飲み物とか…", 3, 2, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1311, "ひっく、うふふ…\nもっとお姉さんと\nお話しようよ～", 4, 2, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1312, "極力人付き合いは\nしない主義なんだけど\nキミは例外かも…", 101, 2, 0, 0, 1, 103401, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1313, "いつか…\nキミと一緒に飲めたら\n楽しいだろうな", 102, 2, 0, 0, 1, 103401, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1314, "おはよう…朝は\nちょっとつらいな…\n低血圧なのよ…", 1, 2, 0, 1, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1315, "おっひるー♪\nなに食べよっかな～♪", 2, 2, 0, 2, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1316, "ふわあ…\n眠る前にちょっと\n一杯…冗談よ", 3, 2, 0, 3, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1317, "うう…\n髪がボサボサ…\nちゃんとしなきゃ…", 1, 3, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1318, "自然体でゴロゴロ\nするのって\n幸せだなぁ…", 2, 3, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1319, "こういうの男の子に\nプレゼントして\nもらいたいな…", 3, 3, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1320, "うわあ、\nこれ、私の好きな\n香りだー！", 4, 3, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1321, "ぽっかぽか…\nあとは熱い一杯が\nあれば…！", 5, 3, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1322, "家でゴロゴロして\n付いちゃったお肉を\n落とさないと…！", 6, 3, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1323, "もぐもぐ…\nおーいしー！\n…太らないよね？", 7, 3, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1324, "大人の女らしく\n色んなことを学んで\nおかなくっちゃ", 8, 3, 0, 0, 1, 103401, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1326, "仕事終わりの一杯の\nために、今日も\n頑張らないと", 1, 1, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1327, "今日は\nのんびり\n過ごそうかな～", 2, 1, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1328, "あ…\nお皿、洗って\nなかった…", 3, 1, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1329, "もう少し、大人の\n魅力が出せるように\nなりたいな", 4, 1, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1330, "素敵な彼氏…\n欲しいなぁ…", 5, 1, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1331, "彼と私\n釣り合うかな…\n大丈夫よね？", 101, 1, 0, 0, 1, 103402, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1332, "今後のために\nちょっとは花嫁修業\nしてみようかな…？", 102, 1, 0, 0, 1, 103402, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1333, "何事も\nお姉さんと一緒に\n楽しく頑張りましょ？", 1, 2, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1334, "ね、ねえ！\nキミは年上と年下\nどっちが好きかな？", 2, 2, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1335, "もう…\n構ってくれないと\n泣いちゃうぞ～？", 3, 2, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1336, "お姉さんが～\n可愛がって\nあげようか～？", 4, 2, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1337, "極力人付き合いは\nしない主義なんだけど\nキミは例外かも…", 101, 2, 0, 0, 1, 103402, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1338, "お姉さんとチュー\nする？　ふふふ～\n冗談で～す！", 102, 2, 0, 0, 1, 103402, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1339, "さーて、今日も\nいっちょやるぞー！", 1, 2, 0, 1, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1340, "後でのんびり\nストレッチでも\nしようっと♪", 2, 2, 0, 2, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1341, "一日よく働いた～！\n自分にごほうび\nあげたいなー♪", 3, 2, 0, 3, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1342, "仕事の前に、髪とか\n整えないと…", 1, 3, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1343, "自然体でゴロゴロ\nするのって\n幸せだなぁ…", 2, 3, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1344, "もう大人だし…\nあんまり可愛いのは\n似合わないかな…？", 3, 3, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1345, "うわあ\nこれ、私の好きな\n香りだー！", 4, 3, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1346, "あったかーい…\nだ、だらけ\nちゃいそう…", 5, 3, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1347, "地道な努力が\nリア充への\n第一歩！", 6, 3, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1348, "おーいしっ♪\nこのために\n生きてるわねえ", 7, 3, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1349, "大人の女らしく\n色んなことを学んで\nおかなくっちゃ", 8, 3, 0, 0, 1, 103402, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1351, "大切な人に\n本をすすめるのって\nけっこう難しいなぁ", 1, 1, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1352, "き、きらーん☆\nお姉ちゃんに\n似てるかな…？", 2, 1, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1353, "そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…", 3, 1, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1354, "ちょっと、休憩…\n本でも読もうかな", 4, 1, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1355, "もっとたくさんの本に\n囲まれて生活したいな", 5, 1, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1356, "むかしむかしある所に\nシオリと\nあの人が…", 101, 1, 0, 0, 1, 103801, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1357, "この本の主人公、\nあの人に\n似ているかも…\nかっこいいな", 102, 1, 0, 0, 1, 103801, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1358, "ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？", 1, 2, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1359, "あ…お姉ちゃんと\n約束があったんだ…", 2, 2, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1360, "しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…", 3, 2, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1361, "最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？", 4, 2, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1362, "読みたい本も\nあなたと行きたい所も\n増えるばっかりです", 101, 2, 0, 0, 1, 103801, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1363, "私の病気、\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…", 102, 2, 0, 0, 1, 103801, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1364, "えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…", 1, 2, 0, 1, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1365, "ふぅ…午前中\n動いたので体力が…\nすこし休みますね", 2, 2, 0, 2, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1366, "早く寝ないと\n体に良くないですよね\nでも気になっている\n本があって…", 3, 2, 0, 3, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1367, "寝てばかりなので、\n髪が乱れてないかな\n…？", 1, 3, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1368, "少し休もう\n…やっぱり\nたくさん休もう", 2, 3, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1369, "かわいいものが\n枕元にあると\n安心できるんですよ", 3, 3, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1370, "いい香り…\n病は気からと言うので\n雰囲気も大事ですね", 4, 3, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1371, "こうして温まって\nいると、病気も\n治る気がします", 5, 3, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1372, "運動…イメージ\nトレーニングだけじゃ\nだめでしょうか…", 6, 3, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1373, "少食ですけど\nこれならたくさん\n食べられそうです", 7, 3, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1374, "続きが気になって\n読むのを止める\nタイミングが…", 8, 3, 0, 0, 1, 103801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1376, "しっかり休まないと\n早く回復するように", 1, 1, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1377, "き、きらーん☆\nお姉ちゃんに\n似てるかな…？　", 2, 1, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1378, "病室よりも…\nずっとこの部屋に\nいたいですね…　", 3, 1, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1379, "そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…", 4, 1, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1380, "大切な人に\n本をすすめるのって\nけっこう難しいなぁ", 5, 1, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1381, "むかしむかしある所に\nシオリと\nあの人が…", 101, 1, 0, 0, 1, 103802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1382, "あの人の\nためにも早く\n病気を治さないと…", 102, 1, 0, 0, 1, 103802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1383, "ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？", 1, 2, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1384, "新記録です！\n一週間連続、\n平熱を保ちました！", 2, 2, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1385, "あ…お薬の時間…\n苦いけど我慢しなきゃ　", 3, 2, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1386, "最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？", 4, 2, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1387, "しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…", 101, 2, 0, 0, 1, 103802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1388, "私の病気\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…", 102, 2, 0, 0, 1, 103802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1389, "えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…", 1, 2, 0, 1, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1390, "…お昼の薬？\nあ、飲み忘れてました\nありがとうございます", 2, 2, 0, 2, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1391, "この薬を飲むと\n眠くなっちゃうんです\nでもまだ、あなたと\nお話したいし～", 3, 2, 0, 3, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1392, "寝てばかりなので、\n髪が乱れてないかな\n…？　", 1, 3, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1393, "少し休もう\n…やっぱり\nたくさん休もう", 2, 3, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1394, "この子がいれば\n病室に一人でも\n寂しくないですね", 3, 3, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1395, "いろんな効能が？\n健康になる香りも\nあるのでしょうか？", 4, 3, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1396, "こうして温まって\nいると、病気も\n治る気がします", 5, 3, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1397, "私も、少しは\n体力をつけないと\nいけませんよね　", 6, 3, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1398, "いっぱい食べて\n健康な体にならないと", 7, 3, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1399, "続きが気になって\n読むのを止める\nタイミングが…", 8, 3, 0, 0, 1, 103802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1401, "友達ができたら、\n山の上でお弁当…\n夢が広がります…", 1, 1, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1402, "あ、忘れずに\nお花に水を\nあげなきゃ…", 2, 1, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1403, "お菓子を作って、\nみなさんに振る舞って\n友達作戦！　とか…", 3, 1, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1404, "そろそろ新しい\n草人形を作って\n友達作りの特訓を…", 4, 1, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1405, "植物のお世話って、\nぼっちにとっては、\n救い…なんです…", 5, 1, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1406, "ＢＢ団の活動日…\nまだかな…\nうふふふっ", 101, 1, 0, 0, 1, 104001, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1407, "もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…", 102, 1, 0, 0, 1, 104001, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1408, "あ、こんにちは！\n今日もＢＢ団で\nお世話になります！", 1, 2, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1409, "あの…私の友達作りの\n練習方法、間違って\nませんよね…？", 2, 2, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1410, "そうだ、今度、\n森に一緒に木の苗を\n植えに行きませんか？", 3, 2, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1411, "人とお話するのって、\n私、大好きです！\n友達ふやすぞ～！", 4, 2, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1412, "あなたと話してると、\nまるで私がぼっちじゃ\nないみたいです！", 101, 2, 0, 0, 1, 104001, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1413, "友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです", 102, 2, 0, 0, 1, 104001, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1414, "おはようございます！\n今日もＢＢ団、\nがんばるぞー！", 1, 2, 0, 1, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1415, "なんだか、お腹が\n空いてきました。\nお昼ごはんー♪", 2, 2, 0, 2, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1416, "もう眠いかもです…\n明日は友達、\nできるといいなあ…", 3, 2, 0, 3, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1417, "私がもっと\n可愛ければ、\n友達できるかなあ？", 1, 3, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1418, "ふわあ…のんびり\nしすぎないように\n気を付けなきゃです", 2, 3, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1419, "かわいいなあ。\nこの子とも\n友達になりたい…", 3, 3, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1420, "いい香りです…\n精神統一して\n友達のイメトレ…", 4, 3, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1421, "灯りを見てると、\n心がなごみます～", 5, 3, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1422, "もぐもぐ…\nおいしいです…！\nみなさんもぜひ！", 6, 3, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1423, "おいしいです…\n私に友達がいたら、\n分けてあげたいな", 7, 3, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1424, "友達作りの\n参考になりそうなこと\n書いてないかな～？", 8, 3, 0, 0, 1, 104001, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1426, "友達作りは、焦らず\n慌てず、じっくりと…", 1, 1, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1427, "ひとつ屋根の下\nって感じ…\nいいですねえ…", 2, 1, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1428, "煮汁、煮汁が\n噴きこぼれて\nいませんか～", 3, 1, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1429, "今度、みなさんと\nピクニックとか…\nいってみたいな", 4, 1, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1430, "ぼっちでもいい\nたくましく育てば\n…なんて", 5, 1, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1431, "最近、毎日あの人の\nこと考えちゃいます\nどうしてだろう…", 101, 1, 0, 0, 1, 104002, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1432, "もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…", 102, 1, 0, 0, 1, 104002, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1433, "あ！　ＢＢ団の活動\nですか？　嬉しくて\n飛び跳ねちゃいます！", 1, 2, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1434, "あなたとのお話で友達\n作りの練習になるなら\n一石二鳥です！", 2, 2, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1435, "私少しは人と話しても\nテンパらなくなって\nきましたかね…？", 3, 2, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1436, "あの、友達作りの\n新しい作戦\n考えてみたんですっ！", 4, 2, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1437, "あなたとお話する時の\nこの気持ち、私の宝物\nなんです…えへへ", 101, 2, 0, 0, 1, 104002, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1438, "友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです", 102, 2, 0, 0, 1, 104002, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1439, "朝ですね！\nこんないい朝は\n友達作りのチャンス！", 1, 2, 0, 1, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1440, "あの…そろそろお腹\nすきませんか？\nお昼ごはんは…", 2, 2, 0, 2, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1441, "もう眠いかもです…\n明日は友達\nできるといいなあ…", 3, 2, 0, 3, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1442, "私…見た目\nそこまで変じゃ\nないですよね…？", 1, 3, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1443, "ほわあ～…\nふかふかって\nいいものですね～", 2, 3, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1444, "この子みたいな\nあいくるしさを\n目指したいです！", 3, 3, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1445, "灯りを見てると\n心がなごみます～", 4, 3, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1446, "ぬくぬくで、なんだか\n眠くなっちゃいますね", 5, 3, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1447, "身体を鍛えて\nみなさんを\n守ります！", 6, 3, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1448, "もぐもぐ…\nおいしいです…！\nみなさんもぜひ！", 7, 3, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1449, "友達作りの\n参考になりそうなこと\n書いてないかな～？", 8, 3, 0, 0, 1, 104002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1451, "唱喚の歌は、みだりに\n歌っていいものでは\nないんです", 1, 1, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1452, "ここでアイドルの\n練習は、さすがに\n迷惑ですよね？", 2, 1, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1453, "練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな", 3, 1, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1454, "人々の平和を守る旅に\n同行してくれる人を\n探していて…", 4, 1, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1455, "あとで曲を復習して\nおかないと…", 5, 1, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1456, "踊りを見られるのは\nまだ恥ずかしいけど\nあの人になら…", 101, 1, 0, 0, 1, 104201, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1457, "浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？", 102, 1, 0, 0, 1, 104201, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1458, "いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！", 1, 2, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1459, "え、もう練習の時間？\nごめんなさい\nすぐ準備します！", 2, 2, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1460, "守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね", 3, 2, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1461, "歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？", 4, 2, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1462, "～～♪　あれ？\n今私、歌ってました？\n気づきませんでした", 101, 2, 0, 0, 1, 104201, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1463, "…歌って欲しい？\n喜んで♪\nどの歌にしましょう？", 102, 2, 0, 0, 1, 104201, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1464, "おはようございます♪\n少し歌の練習を\nしてきますね", 1, 2, 0, 1, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1465, "もうお昼なんですか？\n練習に夢中で\n気づきませんでした", 2, 2, 0, 2, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1466, "明日の予定は…\nアイドルはやることが\n多いみたいで…", 3, 2, 0, 3, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1467, "見た目については\n前よりも気をつけてと\nノゾミに言われてます", 1, 3, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1468, "歌の調子をよくする\nためには休息も\n必要ですよね…", 2, 3, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1469, "この子たちを\n相手に練習して\nみようかな…♪", 3, 3, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1470, "…疲れてるのかな\n落ち着けているのが\n自分でもわかります", 4, 3, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1471, "ここにいると\n穏やかな旋律が\n浮かんできます…", 5, 3, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1472, "歌うためには\n体力づくりは\n欠かせません", 6, 3, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1473, "歌った後は\nお腹が空いて\nしまうんです", 7, 3, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1474, "音楽について\n理論も勉強\nしないと…", 8, 3, 0, 0, 1, 104201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1476, "歌うことの楽しさ\n分かってきました\nもっと歌いたいな…", 1, 1, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1477, "練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな", 2, 1, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1478, "精霊も強くなったし\nもっとたくさんの人を\n守りたいです", 3, 1, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1479, "最近、よく頭の中に\n歌が浮かんできます\n不思議な感覚…", 4, 1, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1480, "楽譜を買いました\n思いついた歌を\n書き留めておくために", 5, 1, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1481, "浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？", 101, 1, 0, 0, 1, 104202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1482, "私の中にある\n私だけの歌…\n作ってみようかな？", 102, 1, 0, 0, 1, 104202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1483, "守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね", 1, 2, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1484, "歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？", 2, 2, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1485, "魔物退治ですか！？\n…違います？\n良かった…", 3, 2, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1486, "いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！", 4, 2, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1487, "…歌って欲しい？\n喜んで♪\nどの歌にしましょう？", 101, 2, 0, 0, 1, 104202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1488, "～～♪　あれ？\n今私、歌ってました？\n気づきませんでした", 102, 2, 0, 0, 1, 104202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1489, "呼吸を深く、大きく…\nこれでちゃんと\n目が覚めますよ", 1, 2, 0, 1, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1490, "少し休んだら\n午後の練習に\n行ってきますね", 2, 2, 0, 2, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1491, "曲を作っていたら\nもうこんな時間…\nおやすみなさい", 3, 2, 0, 3, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1492, "見た目については\n前よりも気をつけてと\nノゾミに言われてます", 1, 3, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1493, "あ～…♪\nよく体がほぐれます…\nいい歌が歌えそうです", 2, 3, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1494, "かわいいと思う\n気持ちを、歌にしても\nいいかも知れませんね", 3, 3, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1495, "…疲れてるのかな\n落ち着けているのが\n自分でもわかります", 4, 3, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1496, "ここにいると\n穏やかな旋律が\n浮かんできます…", 5, 3, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1497, "もっと体力をつけて\n最高のライブを\nファンに届けます！", 6, 3, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1498, "これでも一応\n体形には気をつけて\n食べてるんですよ？", 7, 3, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1499, "読書は歌に\n新しい風を\n吹き込んでくれます", 8, 3, 0, 0, 1, 104202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1501, "店の新メニューでも\n考えるかな", 1, 1, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1502, "あたしの店から、\n出前を届けようか？", 2, 1, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1503, "パトロール、\nパトロール…\nここは異常なしかな？", 3, 1, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1504, "腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？", 4, 1, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1505, "のんびりし過ぎるのも\n…性に合わねぇな", 5, 1, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1506, "そろそろあいつ、\n腹すかしてるん\nじゃないかな？", 101, 1, 0, 0, 1, 104301, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1507, "今日の献立は…\nあいつの好きなものに\nしてやるか", 102, 1, 0, 0, 1, 104301, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1508, "強くなりたいなら、\nあたしがビシバシ\n鍛えてやるよ", 1, 2, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1509, "天気がいい日は\n外で運動したく\nならねぇか？", 2, 2, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1510, "腹減ったか？　なんか\n作ってやろうか？", 3, 2, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1511, "ん？　なんだよ、\n相談事か？\nなんでも言ってくれ", 4, 2, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1512, "お前が好きな飯って\nなんだ？\n今度、作ってやるよ", 101, 2, 0, 0, 1, 104301, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1513, "お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ", 102, 2, 0, 0, 1, 104301, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1514, "気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか", 1, 2, 0, 1, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1515, "昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ", 2, 2, 0, 2, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1516, "日中たっぷり動いたら\nそのぶん夜はしっかり\n休んどけよな", 3, 2, 0, 3, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1517, "た、たまにはその…\nかわいい格好とか\nしても…", 1, 3, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1518, "ふわぁ、\n一休みすっかなぁ～", 2, 3, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1519, "うっ！　か、かわいい\nじゃねぇか", 3, 3, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1520, "へー　いい匂いだな\nあいつもこういうの\n好きなのかな…", 4, 3, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1521, "ふわぁ〜！\n温かいと、つい\nウトウトしちまうな", 5, 3, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1522, "オラオラオラーーー！\n燃えるぜーーー！", 6, 3, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1523, "いい味してるぜ！\nうちの店でも\n出してみたいな", 7, 3, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1524, "文字を読んでると\nどうしても眠く\nなっちまうんだよなぁ", 8, 3, 0, 0, 1, 104301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1526, "パトロール終了～\n本日も異常なしっと！", 1, 1, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1527, "あたしの店から\n出前を届けようか？", 2, 1, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1528, "あいつ、早く\n帰ってこないかな", 3, 1, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1529, "あいつ\n腹すかせてないと\nいいんだけど…", 4, 1, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1530, "のんびりし過ぎるのも\n…性に合わねぇな", 5, 1, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1531, "あいつの事を思うと\n胸があったかくなる？\nなんだコレ…？", 101, 1, 0, 0, 1, 104302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1532, "今日の献立は…\nあいつの好きなものに\nしてやるか", 102, 1, 0, 0, 1, 104302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1533, "ん？　なんだよ\n相談事か？\nなんでも言ってくれ", 1, 2, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1534, "天気がいい日は\n外で運動したく\nならねぇか？", 2, 2, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1535, "腹減ったか？　なんか\n作ってやろうか？", 3, 2, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1536, "腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？", 4, 2, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1537, "あのさ…できれば\nもっとそばに…いや\nなんでもねぇ忘れろ！", 101, 2, 0, 0, 1, 104302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1538, "お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ", 102, 2, 0, 0, 1, 104302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1539, "気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか？", 1, 2, 0, 1, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1540, "昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ", 2, 2, 0, 2, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1541, "あんま夜更しすんなよ\n明日に響いたら\n大変だろ？", 3, 2, 0, 3, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1542, "た、たまにはその…\nかわいい格好とか\nしても…", 1, 3, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1543, "ふぅ～♪\n疲れがとれるな～", 2, 3, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1544, "うっ！　か、かわいい\nじゃねぇか", 3, 3, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1545, "へー　いい匂いだな\nあいつもこういうの\n好きなのかな…", 4, 3, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1546, "ふわぁ～！\n温かいと、つい\nウトウトしちまうな", 5, 3, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1547, "オラオラオラーーー！\n燃えるぜーーー！", 6, 3, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1548, "いい味してるぜ！\nうちの店でも\n出してみたいな", 7, 3, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1549, "料理だけじゃなく\n経営術とかも\n学んどかねぇと…", 8, 3, 0, 0, 1, 104302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1551, "最近なにも\nしてくれません…\n焦らしてるんですね", 1, 1, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1552, "ぐふふ、じゅるり…\nい、いけない、また\nいつの間にかよだれが", 2, 1, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1553, "好きな武器といえば\n剣より槍より\nやっぱり鞭…ぐふふ", 3, 1, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1554, "「無数の触手が\nクウカの柔肌に\n食い込み」…ぐふふ", 4, 1, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1555, "もしドＳさんが\nＭに転じたらと思うと\n身の毛がよだちます！", 5, 1, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1556, "ドＳさんを登場\nさせるだけで、妄想に\n無限の広がりが！", 101, 1, 0, 0, 1, 104501, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1557, "あっ…\nジロジロ見てたの\n気づいちゃいました？", 102, 1, 0, 0, 1, 104501, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1558, "視線を感じると\n思ったら…やはり\nドＳさんでしたか", 1, 2, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1559, "今日は\nどんなヒドイことを\nしてくれるんですか？\nぐふふふ", 2, 2, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1560, "いつの間にそこに！？\nまさかクウカを監視\nしていたのですか！？", 3, 2, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1561, "クウカに触るつもり\nですか？　触るつもり\nなのですねっ！？", 4, 2, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1562, "クウカにナニをする\nつもりですか…\n期待してしまいます！", 101, 2, 0, 0, 1, 104501, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1563, "ドＳさんの視界に入る\nだけでドキドキが…\nこれが恋！？", 102, 2, 0, 0, 1, 104501, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1564, "おはようございます。\n朝からお盛んですね？\nぐふふ…", 1, 2, 0, 1, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1565, "こんなにも日の高い\nうちからドＳさんは…\nじゅるり", 2, 2, 0, 2, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1566, "夜はこれから、\nですよ…\nぐふ、ぐふふふ…", 3, 2, 0, 3, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1567, "キレイにおめかし\nしたのに力ずくで…\nぐふふふ", 1, 3, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1568, "ソファの背にクウカを\n押し付けて…ぐふふ\nいいですね\nソファドン", 2, 3, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1569, "「見た目とは裏腹に\nそれは激しく攻め\nたてて」…ぐふふふ", 3, 3, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1570, "香りを吸ったクウカの\n頬は紅潮し目はうるみ\nもはや抗う力も…！", 4, 3, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1571, "ああ、身体が\n火照って…\nぐふ、ぐふふ…", 5, 3, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1572, "はぁ、はぁ、こうして\nクウカの体力を\n奪ってから…ぐふふ", 6, 3, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1573, "食欲が満たされたら\nつ、次はやはり…！\nそうなのですね！？", 7, 3, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1574, "この本の下に、\nそういう本を\nカムフラージュ？", 8, 3, 0, 0, 1, 104501, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1576, "「ドＳさんと踊り子\n乱舞の一夜」…\n次の日記はこれで…", 1, 1, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1577, "最近なにも\nしてくれません…\n焦らしてるんですね", 2, 1, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1578, "も、妄想が\n足りません…\n禁断症状がっ…！", 3, 1, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1579, "もしドＳさんが\nＭに転じたらと思うと\n身の毛がよだちます！", 4, 1, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1580, "次はどんなドＳを\nされるのか、想像する\nだけで…ぐふふふ", 5, 1, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1581, "じっとしてると\nドＳさんのことばかり\n考えてしまいますね", 101, 1, 0, 0, 1, 104502, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1582, "妄想が止まらなくて\nクウカどうにかなって\nしまいそうです！", 102, 1, 0, 0, 1, 104502, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1583, "ドＳさんといると体が\n火照って…クウカは\nいやらしい子です！", 1, 2, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1584, "あっ…\nジロジロ見てたの\n気づいちゃいました？", 2, 2, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1585, "ドＳさんのおかげで\n新しい扉が開けそう\nです…じゅるり", 3, 2, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1586, "いやー！　ドＳさんに\n襲われ…襲って\nくれないんですか？", 4, 2, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1587, "クウカはドＳさんに\n身も心も堕とされて\nしまったのですね", 101, 2, 0, 0, 1, 104502, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1588, "ドＳさんがお望みなら\nクウカは\nどんなことだって！", 102, 2, 0, 0, 1, 104502, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1589, "朝だからこそ\nできる妄想が\nあります…ぐふふ", 1, 2, 0, 1, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1590, "こんな日の高いうち\nからドＳさんは…\nじゅるり", 2, 2, 0, 2, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1591, "今夜は一晩中…\nなんですね？\nぐふふ…", 3, 2, 0, 3, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1592, "意外と難しいんですよ\n正しい亀甲縛りと\nいうものは…", 1, 3, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1593, "くつろいで油断\nしているスキに何を\nされるのでしょう！？", 2, 3, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1594, "「見た目とは裏腹に\nそれは激しく攻め\nたてて」…ぐふふふ", 3, 3, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1595, "これは禁断の香り…\nああっ一段階上の\n妄想が開花するうぅ！", 4, 3, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1596, "ああっ、暖気がまるで\nロウソクのように\nクウカを攻めますっ！", 5, 3, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1597, "激しい攻めを受けきる\nためには、鍛えないと\nいけないのですね", 6, 3, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1598, "こんなにいっぱい\n入りません…\nお腹にっ！", 7, 3, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1599, "どんな本も\nよく見ると\nいやらしいです…！", 8, 3, 0, 0, 1, 104502, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1601, "この前遊んだ猫、\nモッフモフ\nだったにゃあ…♪", 1, 1, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1602, "ほっぺやお腹が、\n肉球ぐらいぷにぷに…\nこれはまずいにゃ…", 2, 1, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1603, "大きな仕事が\n決まったにゃ！\n腕が鳴るにゃ～♪", 3, 1, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1604, "おやつのたい焼き、\nつぶあんとこしあん、\nどっちに\nしようかにゃ？", 4, 1, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1605, "うにゃー…\nもうちょっとお昼寝\nしたかったにゃ…\nむにゃむにゃ…", 5, 1, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1606, "キミに呼ばれると、\n猫まっしぐらな気分に\nなっちゃうにゃ♪", 101, 1, 0, 0, 1, 104601, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1607, "キミのおかげで\nギルドの仕事も\n大成功だにゃ♪\nありがとにゃ♪", 102, 1, 0, 0, 1, 104601, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1608, "うずうず…その指、\nじゃれついても\nいいかにゃ？", 1, 2, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1609, "にゃ？　あたしに何か\nご入り用かにゃ？\nお安くしとくにゃ～♪", 2, 2, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1610, "うーん、なんだか\n退屈にゃ～\n遊んで、遊んで～？", 3, 2, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1611, "素早い動きのコツ？\nタダじゃ教えて\nあげられないにゃ～♪", 4, 2, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1612, "そんなにあたしを\nなでたいにゃ？\nキミならなでさせて\nあげてもいいかにゃー", 101, 2, 0, 0, 1, 104601, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1613, "ふにゃあ、ねえねえ、\n一緒にゴロゴロ\nしようにゃあ？", 102, 2, 0, 0, 1, 104601, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1614, "いい朝にゃ！\n顔を洗ってくるにゃ！", 1, 2, 0, 1, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1615, "むーん、そろそろ\nお昼…猫たちにも\n猫缶を…", 2, 2, 0, 2, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1616, "ふわあ…眠いにゃ…\n猫は布団で\n丸くなるにゃ", 3, 2, 0, 3, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1617, "客商売では、\n外見のチェックも\n欠かせないのにゃ！", 1, 3, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1618, "うにゃ～！\nお昼寝に\nぴったりにゃ", 2, 3, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1619, "これ…量産したら\n子どもにバカ売れ\nしそうだにゃ！", 3, 3, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1620, "この灯り、まるで\n猫みたいな\n癒し効果にゃ！", 4, 3, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1621, "ふにゃあ、\nあったかいと猫は丸く\nなっちゃうのにゃあ…", 5, 3, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1622, "本当は外で\n運動したいん\nだけどにゃ", 6, 3, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1623, "むーん、\n美味しいにゃー！\nたい焼きに\n匹敵するにゃ！", 7, 3, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1624, "ふむふむ…猫の\nしつけ方は、と…", 8, 3, 0, 0, 1, 104601, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1626, "かわいいネコの置物を\nゲットしたにゃ！\nどこに飾ろうか\nにゃ～♪", 1, 1, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1627, "仕事の交渉がうまく\n行ったにゃ～♪\nいい気分だにゃ～♪", 2, 1, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1628, "ねこじゃらしには\n食いついちゃうにゃ\nびしっ！　びしっ！", 3, 1, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1629, "ほっぺやお腹が、肉球\nぐらいぷにぷに…\nこれはまずいにゃ…", 4, 1, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1630, "さっきのたいやき\nおいしかったにゃ♪\nごろごろごろ…", 5, 1, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1631, "手作りのたい焼き\nあいつは食べて\nくれるかにゃ…？", 101, 1, 0, 0, 1, 104602, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1632, "あいつには、いつか\nたっぷり恩返しが\nしたいにゃ…", 102, 1, 0, 0, 1, 104602, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1633, "にゃーに？　あたしの\nことがそんなに気に\nなるのかにゃ？", 1, 2, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1634, "あたしのこと…\nしっかり捕まえ\nといてにゃ？", 2, 2, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1635, "あたしの力が\n必要かにゃ？　猫の手\n貸してあげるにゃ♪", 3, 2, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1636, "たいやきとクレープを\n合わせれば…\n新しい商売のニオイが\nするにゃ…！", 4, 2, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1637, "ふにゃあ、ねえねえ\n一緒にゴロゴロ\nしようにゃあ？", 101, 2, 0, 0, 1, 104602, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1638, "キミと一緒にいると\n楽しくなってつい\nじゃれちゃうにゃ！", 102, 2, 0, 0, 1, 104602, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1639, "いい朝にゃ！\n顔を洗ってくるにゃ！", 1, 2, 0, 1, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1640, "そろそろおっひる～\nにゃーんか\n食べたい…", 2, 2, 0, 2, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1641, "うーん、眠くなって\nきたにゃ。あたしは\n夜行性じゃないのにゃ", 3, 2, 0, 3, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1642, "にゃにゃ…\n髪が乱れてるにゃ", 1, 3, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1643, "ふっかふかにゃ～\n猫がねころん\nじゃうにゃ", 2, 3, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1644, "これ、猫と匹敵する\nぐらいかわいいにゃ！", 3, 3, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1645, "猫でもこわくない\n優しい灯りにゃ！", 4, 3, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1646, "ぽっかぽか\nしあわせな気分にゃ～", 5, 3, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1647, "雨の日でも運動\nできるのは、濡れ\nなくて便利だにゃ！", 6, 3, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1648, "美味しいにゃ～！\nこれ、朝昼晩\n食べたいにゃ！", 7, 3, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1649, "本を読んで\n猫の気持ちを\n勉強するのにゃ！", 8, 3, 0, 0, 1, 104602, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1651, "内職手伝える人\nいないかしら？", 1, 1, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1652, "次の依頼は、\nこういう計画で…\nうん、完璧ね！", 2, 1, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1653, "次の特売セールに\n向けて、しっかり\n準備しないと！", 3, 1, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1654, "配達の後に売り子\n次に採取のバイト…\nうん、効率的ね", 4, 1, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1655, "一日に受ける\nバイトの数、もう少し\n増やしたいわね", 5, 1, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1656, "師匠として\n頼りにされたいし\nもっと頑張らなきゃ！", 101, 1, 0, 0, 1, 104801, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1657, "男の子と効率的に\n仲良くなる方法…\nこればっかりは難題ね", 102, 1, 0, 0, 1, 104801, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1658, "あら、\nちょうどよかった\n今から一緒に\nバイトでもどう？", 1, 2, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1659, "相談事かしら？\nそれくらいなら\n無料でいいわよ", 2, 2, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1660, "背後の気配なら\nすぐ分かるわ\n試してみる？", 3, 2, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1661, "道具やお金の管理は\n大丈夫？　手伝うから\nいつでも言って", 4, 2, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1662, "暇ができたから\n働きたいけど…\nキミとの時間も大切ね", 101, 2, 0, 0, 1, 104801, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1663, "ねえ、あの…\n私はキミにとって…\nいや、何でもないわ", 102, 2, 0, 0, 1, 104801, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1664, "おはよう！\n今日も朝から\nバイトよ！", 1, 2, 0, 1, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1665, "お昼時ね。\n少し休憩したら、\nまた働くわよ！", 2, 2, 0, 2, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1666, "もうこんな時間！\n明日もバイトで\n朝早いのよ…", 3, 2, 0, 3, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1667, "接客業の依頼が\nある時は、外見も\nキレイにしないとね", 1, 3, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1668, "はぁ～バイトで\n疲れたから癒される～", 2, 3, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1669, "これを内職で\n作ったら\n儲かるかしら？", 3, 3, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1670, "リフレッシュできたわ\nこれでまた、バリバリ\n働けるわね！", 4, 3, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1671, "風邪を引いたら効率が\n落ちちゃうから、\n暖めないと！", 5, 3, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1672, "働き続けるには\n健康第一！　それには\n運動が一番よ", 6, 3, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1673, "もぐもぐ…\n腹が減っては\n戦ができぬ、よ！", 7, 3, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1674, "日々絶えず学んで、\n生活に活かすのよ！", 8, 3, 0, 0, 1, 104801, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1676, "家計簿をつけなきゃ！\n覚えている時に\nやっておかないとね", 1, 1, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1677, "次の依頼は\nこういう計画で…\nうん、完璧ね！", 2, 1, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1678, "ギルドの経費\nあとちょっとだけ\n削れそうね…", 3, 1, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1679, "少しでも時給のいい\nバイトがしたいけど\nなかなか\n出会えないのよ", 4, 1, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1680, "今度のバイトも\nなかなか大変そう\nね…腕が鳴るわ", 5, 1, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1681, "男の子と効率的に\n仲良くなる方法…\nこればっかりは難題ね", 101, 1, 0, 0, 1, 104802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1682, "私、どうしたんだろ？\n仕事中もずっと\n彼のこと考えてる…", 102, 1, 0, 0, 1, 104802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1683, "この間はヘルプに\n来てくれてありがとう\n頼んで正解だったわ", 1, 2, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1684, "見つけた！　ちょうど\n頼みたいことが\nあるんだけど、いい？", 2, 2, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1685, "今から\n休憩するところなの\n一緒にどう？", 3, 2, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1686, "ん？　どうしたの？\n私のことが\n気になるの？", 4, 2, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1687, "…たまには甘えても\nいい？　私だって\n弱る時はあるのよ", 101, 2, 0, 0, 1, 104802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1688, "暇ができたから\n働きたいけど…\nキミとの時間も大切ね", 102, 2, 0, 0, 1, 104802, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1689, "おはよう！\nいい朝ね。一緒に\nランニングでもいく？", 1, 2, 0, 1, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1690, "お昼時ね\n少し休憩したら\nまた働くわよ！", 2, 2, 0, 2, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1691, "もうこんな時間！\n明日もバイトで\n朝早いのよ…", 3, 2, 0, 3, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1692, "女の子らしく…\nどうも忘れちゃう\nのよね", 1, 3, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1693, "ここで少し\n休んだら\nまたバイトよ！", 2, 3, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1694, "これを内職で\n作ったら\n儲かるかしら？", 3, 3, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1695, "仕事から帰ってきて\nこういうのがあると\n素敵ね", 4, 3, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1696, "しっかり身体を\n温めて、血流を\nよくしなくっちゃ", 5, 3, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1697, "これで休憩中も\n無駄なく\n鍛えられるわ♪", 6, 3, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1698, "もぐもぐ…よく\n食べて、よく働く！\nそれが私のモットーよ", 7, 3, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1699, "日々絶えず学んで\n生活に活かすのよ！", 8, 3, 0, 0, 1, 104802, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1701, "暇だし、お料理と\nお掃除とお洗濯と\n買い物しようかな？", 1, 1, 0, 0, 1, 104901, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1702, "こうして歩いていれば\n弟くんが声をかけて\nくれるはず…", 2, 1, 0, 0, 1, 104901, 1);
