INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1788, "これから出かけるの？\nしっかりアタシを\nエスコートしてね！", 102, 2, 0, 0, 1, 105002, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1789, "レディの朝は\n忙しいのよ", 1, 2, 0, 1, 1, 105002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1790, "お腹すいたー\nダイエット\nやめちゃおうかなー", 2, 2, 0, 2, 1, 105002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1791, "エイジングケアを\nしないとねー", 3, 2, 0, 3, 1, 105002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1792, "身だしなみチェック\nオッケー！　これで\nいつアイツが来ても\n大丈夫ね！", 1, 3, 0, 0, 1, 105002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1793, "あ！　これ雑誌で\n見たことあるわ～\nだからきっと\nオシャレなのよ！", 2, 3, 0, 0, 1, 105002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1794, "あたしがもっと\nオシャレにかわいく\nしてあげようか？", 3, 3, 0, 0, 1, 105002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1795, "オシャレ～♪\n大人なレディって\n感じよね♪", 4, 3, 0, 0, 1, 105002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1796, "あったかーい♪\nここで宿題\nしようかしら？", 5, 3, 0, 0, 1, 105002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1797, "運動したら成長\nしないかしら？\n背とか胸とか…", 6, 3, 0, 0, 1, 105002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1798, "レディは、食べ物にも\n気を使うのよ", 7, 3, 0, 0, 1, 105002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1799, "おもしろーい！\n…でも絵本って\n子供っぽいかしら？", 8, 3, 0, 0, 1, 105002, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1801, "魔法と科学\nどっちも極めて\nみせるわ", 1, 1, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1802, "仕事も片付いたし\n部屋で\n実験実験…♪", 2, 1, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1803, "たまった治療代の\n請求書を\nまとめないと…", 3, 1, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1804, "新薬が出来たし\nすぐに試したいけど…\n実験台がいないわ", 4, 1, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1805, "部屋にこもりすぎると\n曜日の感覚が\nなくなるわね", 5, 1, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1806, "あの子の記憶を\n取り戻せる薬…\n作れないものかしら", 101, 1, 0, 0, 1, 105101, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1807, "好意に気づいて貰える\n薬って、どうすれば\n作れるのかしら", 102, 1, 0, 0, 1, 105101, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1808, "あら、ヒマなら\n薬草の整理を\n手伝って", 1, 2, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1809, "もしかして実験に\n付き合ってくれるの？\nえ？　違う？", 2, 2, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1810, "具合が悪い？\nなら診てあげる\nまずは触診から…", 3, 2, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1811, "植物に興味あるの？\nなら教えてあげるわ\n色々とね…", 4, 2, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1812, "キミの傍にいるだけで\n高揚しちゃうのは\n何故かしら…？", 101, 2, 0, 0, 1, 105101, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1813, "私はおしおきする\n側のことが多いけど…\nキミにはされたいかも", 102, 2, 0, 0, 1, 105101, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1814, "お昼までに調合用の\n花を集めたいの\n手伝ってくれる？", 1, 2, 0, 1, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1815, "あら、もうお昼？\nそろそろ一息\n入れましょうか", 2, 2, 0, 2, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1816, "夜も更けて来たわね\n私は朝まで実験だけど\n見学していく？", 3, 2, 0, 3, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1817, "医者たるもの\nいつだって\n清潔に…♪", 1, 3, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1818, "いいわねこれ\n仮眠の時に\n使わせてもらうわ", 2, 3, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1819, "ぬいぐるみなら\n動物も…", 3, 3, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1820, "いい香り…\n仕事場にも\n置いてみようかしら", 4, 3, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1821, "ここにいると\nついウトウト\nしちゃうわ…", 5, 3, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1822, "座ってる時間が多いと\n運動不足になるし\nたまにはいいわね", 6, 3, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1823, "研究していると\nつい食べるのを\n忘れちゃうのよね", 7, 3, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1824, "実験もいいけど\nいつか成果を\n本にしないと…", 8, 3, 0, 0, 1, 105101, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1826, "徹夜はツラいけど\n集中すると時間の\n感覚がなくなって…", 1, 1, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1827, "痛みに悶える顔って\nどうしてあんなに\n興奮するのかしら？", 2, 1, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1828, "彼に罵られたら\nどんな気分かしら\n意外と快感かも？", 3, 1, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1829, "毒を薄めると\n薬になるのって\n今でも不思議だわ", 4, 1, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1830, "綺麗なバラには\nトゲがあるけど\n魅力の一つよね", 5, 1, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1831, "カレをさりげなく\n惚れさせる方法を\n研究するわよ…♪", 101, 1, 0, 0, 1, 105102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1832, "好意に気づいて貰える\n薬って、どうすれば\n作れるのかしら", 102, 1, 0, 0, 1, 105102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1833, "構って欲しいの？\nじゃあ、君の体を\n調べさせて？", 1, 2, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1834, "実験に付き合って\n大丈夫よ、試すのは\nただの栄養剤だから", 2, 2, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1835, "欲しい薬が\nあったら言ってね\n調合してみるから", 3, 2, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1836, "おしおきされたいの？\nキミにだったら\nいつでもしてあげる", 4, 2, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1837, "キミの傍にいるだけで\n高揚しちゃうのは\n何故かしら…？", 101, 2, 0, 0, 1, 105102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1838, "私はおしおきする\n側のことが多いけど…\nキミにはされたいかも", 102, 2, 0, 0, 1, 105102, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1839, "朝しか取れない\n植物があるの\n採取しに行くわよ", 1, 2, 0, 1, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1840, "お昼時ってやけに\n眠たくなるわよね\n…調べたくなるわ", 2, 2, 0, 2, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1841, "今日くらいは\nゆっくり眠りたいわ\n…キミと一緒にね", 3, 2, 0, 3, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1842, "身なりについて\n研究するのも\n楽しそうね", 1, 3, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1843, "休息に必要な道具は\n妥協せずに選ぶ！\nこれだけは譲れないわ", 2, 3, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1844, "たまにはこういう\n可愛らしいものに\n触れないとね♪", 3, 3, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1845, "いい香り…\n仕事場にも\n置いてみようかしら", 4, 3, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1846, "仕事がなかったら\nこのまますーっと\n眠りたいのに…", 5, 3, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1847, "運動しないと\n体型の維持が…", 6, 3, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1848, "適度な食事も\n大切よね", 7, 3, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1849, "まさか私が\n恋愛読本を読む\n日が来るなんて…", 8, 3, 0, 0, 1, 105102, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1851, "ぺっぺっ！\n…い、いけないっ！", 1, 1, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1852, "いっけな～い！\nひづめで床に傷が！", 2, 1, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1853, "太っちゃったかも～！\n伐採でダイエット\nしなくっちゃ！", 3, 1, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1854, "きちんと生活すると\n毛づやが良くなる\nみたいなのよね～", 4, 1, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1855, "みんな、体重\nどれくらいなのかな？", 5, 1, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1856, "体力なら自信\nあるんだけど…\n恋にはちょっぴり\n臆病になっちゃう", 101, 1, 0, 0, 1, 105201, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1857, "いつか人間の女の子\nみたいなデート、\nしてみたいな～♪", 102, 1, 0, 0, 1, 105201, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1858, "私ね「どこにでもいる\n普通の女の子」って\n言葉が憧れなんだ～♪", 1, 2, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1859, "チャームポイント？\n自分では分からない\nけど…まつげかなぁ？", 2, 2, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1860, "リマリマ～♪\nはっ！？\nわ、私ったら今何を？", 3, 2, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1861, "力仕事ならまかせて！", 4, 2, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1862, "人間になりたいな～\nそれか、あなたが\n私みたいな姿に…♪", 101, 2, 0, 0, 1, 105201, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1863, "しょうがないなあ、\nこんなにモフらせるの\nあなただけだよ？", 102, 2, 0, 0, 1, 105201, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1864, "今朝は寝癖がひどいわ\nしっぽの辺りとか～", 1, 2, 0, 1, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1865, "ランチは\nおしゃれなカフェで\nしてみたいな～♪", 2, 2, 0, 2, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1866, "お肌のケアに\nパックしながら\n寝ようかな～", 3, 2, 0, 3, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1867, "やだっ、\nまた寝ぐせついてる！\n直さないと！", 1, 3, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1868, "ミシッっていった！\n私、重すぎるかも！？", 2, 3, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1869, "あ！　あなたも\n美人さんね～♪", 3, 3, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1870, "はぁ、まったり…\n四足歩行しちゃい\nそうだわ…", 4, 3, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1871, "あったか～い♪\n…私、毛皮だから\n暑すぎるかも", 5, 3, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1872, "な、なんだか野生に\n帰っちゃいそう！", 6, 3, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1873, "ぱくぱく、もぐもぐ、\nぺっぺっ…\nやだ、はしたない！", 7, 3, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1874, "きゃーーー！\nこの恋愛小説\nとっても\nドキドキしちゃう～", 8, 3, 0, 0, 1, 105201, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1876, "素敵ね～、居るだけで\n女子力があがりそうな\nお部屋だわ～", 1, 1, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1877, "私、大丈夫かしら？\n他の子に怖がられたり\nしないかな…？", 2, 1, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1878, "動物苑…って\n嫌なギルド名ね…", 3, 1, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1879, "好き、嫌い、好き…\nあっ！　うっかりして\n花占いのお花\n食べちゃった！", 4, 1, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1880, "ここ、女の子らしい\nものでいっぱいね～！\nときめいちゃうわ～♪", 5, 1, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1881, "体力なら自信\nあるんだけど…\n恋にはちょっぴり\n臆病になっちゃう", 101, 1, 0, 0, 1, 105202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1882, "あの人が\n来てくれるまで薪割り\nでもしてよっかな？", 102, 1, 0, 0, 1, 105202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1883, "一緒にお出かけ？\nうれしいけど…\n心の準備が！\nはわわわ！", 1, 2, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1884, "どうしたの？\n急に抱きついてきて…\n癒されたいの？", 2, 2, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1885, "ぺっぺっ！\n…い、いけないっ！", 3, 2, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1886, "メタモルアップルを\nここで食べたら、\nみんな驚くわよね", 4, 2, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1887, "しょうがないなあ、\nこんなにモフらせるの\nあなただけだよ？", 101, 2, 0, 0, 1, 105202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1888, "人間になりたいな～\nそれか、あなたが\n私みたいな姿に…♪", 102, 2, 0, 0, 1, 105202, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1889, "今朝は寝癖がひどいわ\nしっぽの辺りとか～", 1, 2, 0, 1, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1890, "ダイエット中だから\nお昼は抜いてるの～", 2, 2, 0, 2, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1891, "お肌のケアに\nパックしながら\n寝ようかな～", 3, 2, 0, 3, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1892, "ちゃんとかわいく\nしてないと刈られ…\n狩られちゃうもんね！", 1, 3, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1893, "ミシッっていった！\n私、重すぎるかも！？", 2, 3, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1894, "あ！　あなたも\n美人さんね～♪", 3, 3, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1895, "いい香り～\n森の中にいるみたいに\nとっても落ち着く～", 4, 3, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1896, "素敵～♪　…\nきゃっ！　私の毛が\nたいへんなことに～！", 5, 3, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1897, "な、なんだか野生に\n帰っちゃいそう！", 6, 3, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1898, "何を食べるかより\n誰と食べるかが\n大事なのよね", 7, 3, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1899, "きゃーーー！\nこの恋愛小説\nとっても\nドキドキしちゃう～", 8, 3, 0, 0, 1, 105202, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1901, "ヴァイスフリューゲル\nを盛り上げる方法、\n共に語らおう！", 1, 1, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1902, "私は子供ではない…！\nが、お菓子は\nいただこう！", 2, 1, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1903, "部屋はきちんと\n片づけておかなくては\n部屋の汚れは\n心の汚れだ", 3, 1, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1904, "むむむ…明日\n目が覚めたら、身長が\n伸びていないものか…", 4, 1, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1905, "お菓子が常備されて\nいる部屋。そんな\nものが、私の好みだ…", 5, 1, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1906, "あいつとの新たな\n鍛錬が\n待ち遠しいな…！", 101, 1, 0, 0, 1, 105301, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1907, "最近、あいつと\n過ごしていて、毎日が\n充実しているな…", 102, 1, 0, 0, 1, 105301, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1908, "軍人の本分は日々の\n研鑽にあるからな。\n今日も鍛錬に\n行かないか？", 1, 2, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1909, "毎日牛乳を飲んでいる\nのだが、なかなか背が\n伸びないものだな…", 2, 2, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1910, "貴公にも、飴をくれて\nやろうか？\nあまいぞ～！\n美味しいぞ～！", 3, 2, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1911, "私ともっと高く、\n共に飛ぼう！", 4, 2, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1912, "貴公は、本当に頼りに\nなる男だな…いや、\nふとそう思っただけだ", 101, 2, 0, 0, 1, 105301, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1913, "貴公と共にいられる\nことは私の喜びだ。\nこれからも\nよろしく頼むぞ", 102, 2, 0, 0, 1, 105301, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1914, "うむ、いい朝だ。\n本国の夜明けを\n思い出してしまうな！", 1, 2, 0, 1, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1915, "そろそろ昼食に\nするか。腹が減っては\n戦はできないからな", 2, 2, 0, 2, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1916, "ふわああ…私は子供\nではないが…眠い時は\n眠いのだ…", 3, 2, 0, 3, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1917, "身だしなみは、心の\n在りようを映すから\n気をつけなくてはな", 1, 3, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1918, "ふう…軍人たるもの\n常日頃、油断は\nできないのだが…\nお、落ち着くな…", 2, 3, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1919, "うむ…このかわいさ…\n本国に持って\n帰りたい…", 3, 3, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1920, "このともし火、戦いに\n明け暮れる我らの心を\n癒すものだな…", 4, 3, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1921, "はあ～、ぽかぽか…\nい、いや！\n気を緩めないぞっ！", 5, 3, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1922, "うおおおおおっ！\n鍛錬、鍛錬、\n鍛錬っ！！", 6, 3, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1923, "いつ戦いになっても\n困らぬように、\n腹八分目に\nしておくのだ！", 7, 3, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1924, "これを読んで、新たな\n戦術を編み出すぞっ！", 8, 3, 0, 0, 1, 105301, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1926, "たまには掃除でも\nするか。部屋が\n綺麗になるのは\n喜ばしいことだ", 1, 1, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1927, "部屋の中では\n剣を振り回せないのが\n玉に瑕だな…", 2, 1, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1928, "お菓子が常備されて\nいる部屋。そんな\nものが、私の好みだ…", 3, 1, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1929, "毎日牛乳を飲んでいる\nのだが、なかなか背が\n伸びないものだな…", 4, 1, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1930, "家庭を守れない者が\n国を守れるはずが\nない。この部屋も\n私が守るぞ！", 5, 1, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1931, "あいつは今頃、何を\nしているのだろうな…\nふふっ", 101, 1, 0, 0, 1, 105302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1932, "あいつと会える日が\nこんなにも待ち遠しく\nなるとはな…", 102, 1, 0, 0, 1, 105302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1933, "軍人の本分は日々の\n研鑽にあるからな\n今日も鍛錬に\n行かないか？", 1, 2, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1934, "おお、今日も鍛錬の\n時間だったか！\nすまないな\nすぐ行く！", 2, 2, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1935, "私は子供ではない！\nが…たまには童心に\n帰りたい時もある…", 3, 2, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1936, "貴公にも、飴を\nくれてやろうか？\nあまいぞ～！\n美味しいぞ～！", 4, 2, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1937, "私と歩きたいのか…？\nそうだな。二人で\n散歩でも行こうか", 101, 2, 0, 0, 1, 105302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1938, "貴公と共にいられる\nことは私の喜びだ\nこれからも\nよろしく頼むぞ", 102, 2, 0, 0, 1, 105302, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1939, "うむ、いい朝だ\n本国の夜明けを\n思い出してしまうな！", 1, 2, 0, 1, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1940, "そろそろ昼時だな\n鍛錬の手を緩めて\n昼食にするか", 2, 2, 0, 2, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1941, "寝る前に…あと少し\nだけ、鍛錬を…", 3, 2, 0, 3, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1942, "ヴァイス\nフリューゲルの一員と\nして恥ずかしくないよう\n身なりを整えなくては", 1, 3, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1943, "ふう…軍人たるもの\n常日頃、油断は\nできないのだが…\nお、落ち着くな…", 2, 3, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1944, "うむ…このかわいさ…\n本国に持って\n帰りたい…", 3, 3, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1945, "このともし火\n戦いに明け暮れる\n我らの心を\n癒すものだな…", 4, 3, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1946, "はあ～、ぽかぽか…\nい、いや！\n気を緩めないぞっ！", 5, 3, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1947, "うおおおおおっ！\n鍛錬、鍛錬\n鍛錬っ！！", 6, 3, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1948, "いつ戦いになっても\n困らぬように\n腹八分目に\nしておくのだ！", 7, 3, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1949, "うむ…脳細胞が\n活性化してきたぞ\n読書は大事だな", 8, 3, 0, 0, 1, 105302, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1951, "私たちの騎空艇\nどんなデザインに\nしよう…？", 1, 1, 0, 0, 1, 105701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1952, "団員募集の\nポスター\n作ろうっと♪", 2, 1, 0, 0, 1, 105701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1953, "父さん…\n今頃どこで\n何してるんだろ？", 3, 1, 0, 0, 1, 105701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1954, "騎空艇に乗って、\n誰もいったことがない\n場所を見つけたいな", 4, 1, 0, 0, 1, 105701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1955, "父さん以上の\n世界一の\n騎空士になりたい！", 5, 1, 0, 0, 1, 105701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1956, "仲間と行く空の旅…\n何度想像しても\nドキドキするなぁ", 101, 1, 0, 0, 1, 105701, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1957, "父さん…\n私にもね、大切な\n仲間ができたよ", 102, 1, 0, 0, 1, 105701, 8);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1958, "仕事の依頼？\nすぐに支度\nしてくるね！", 1, 2, 0, 0, 1, 105701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1959, "ねえねえ！\n団員募集のポスター\n一緒に作ろうよ！", 2, 2, 0, 0, 1, 105701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1960, "なーにー？\nどうしたの？\n今呼んだよね？", 3, 2, 0, 0, 1, 105701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1961, "今は休憩中だよ？\nだからあなたも\nゆっくりしてて", 4, 2, 0, 0, 1, 105701, 1);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1962, "私にとってあなたは\nとっても頼りになる、\n自慢の団員だよ！", 101, 2, 0, 0, 1, 105701, 4);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1963, "お父さんに会えたら、\n大切な仲間として\nあなたを紹介するね！", 102, 2, 0, 0, 1, 105701, 8);
